/*!40000 ALTER TABLE `ninety_category` DISABLE KEYS */;
INSERT INTO `ninety_category` VALUES (77,'Project complexity',NULL,'a:4:{s:4:\"desc\";s:260:\"Project Complexity refers to the level of difficulty to deliver the project and considers three dimensions: Technical, Project Economics and Commercial. Click on each dimension below and respond to the questions to create an initial Project Complexity profile.\";s:5:\"lower\";s:0:\"\";s:6:\"medium\";s:0:\"\";s:6:\"higher\";s:0:\"\";}','2017-07-06 13:54:51','2017-09-10 09:48:11','risk','true',94,'>94>77',72,10031,1005),(78,'Project environment',NULL,'a:4:{s:4:\"desc\";s:361:\"Project Environment refers to the level of initial understanding of the project context in which the project will be delivered. Three dimensions of organisational preparedness are considered: Project Governance, Project Technology and Project Location.\nClick on each dimension below and respond to the questions to create an initial Project Environment profile.\";s:5:\"lower\";s:0:\"\";s:6:\"medium\";s:0:\"\";s:6:\"higher\";s:0:\"\";}','2017-07-06 13:55:07','2017-09-10 09:48:04','risk','true',94,'>94>78',73,10031,1005),(79,'Project stakeholders',NULL,'a:4:{s:4:\"desc\";s:427:\"Project Stakeholders refer to the composition of stakeholders (individuals or groups) who have an interest in your project, and/or have a level of influence over the achievement of your project objectives.  Project Stakeholder dimensions are: Stakeholder Profile, Stakeholder Communication, and Stakeholder Engagement. Click on each dimension below and respond to the questions to create an initial Project Stakeholder profile.\";s:5:\"lower\";s:0:\"\";s:6:\"medium\";s:0:\"\";s:6:\"higher\";s:0:\"\";}','2017-07-06 13:55:20','2017-09-10 09:47:57','risk','true',94,'>94>79',74,10031,1005),(80,'Technical',NULL,'a:4:{s:4:\"desc\";s:243:\"The Technical dimension of any project considers the level of technical familiarity with the project requirements, and the capability and expertise required at the organisational level to ensure that the project can be successfully delivered. \";s:5:\"lower\";s:783:\"The initial Technical profile of your project indicates strong current capability within your organisation to deliver this project. It is likely that you will have most of the expertise, processes, procedures and tools to ensure that you can move into detailed planning and undertake an initial risk assessment. Since the ‘Technical’ dimension of the project appears to be a ‘lower’ risk area, it is advisable that you access lessons learnt from previous similar projects as you move into the planning stage.  Consider that the ‘Technical’ dimension is only one part of assessing overall ‘Project Complexity’. Continue answering the questions on ‘Project Economics’ and ‘Commercial’ dimensions to gain an overall perspective of the complexity of your project.\";s:6:\"medium\";s:968:\"The initial Technical profile of your project indicates only partial  capability of your organisation to deliver and is currently rated at “medium” risk level. It is likely that you will have some of the expertise, tools and templates, to ensure that you can deliver on the project.  It would be most beneficial to draw on others’ expertise, and where possible access “lessons learnt” from others on related projects with a view to reduce the risk level before moving into the planning stage. Conduct ‘desk’ research to collect information on this particular type of project and seek to validate your findings with the experiences of others – both internal and external to the organisation. Consider the ‘Technical’ dimension is only one part in assessing overall ‘Project Complexity’.  Continue answering the questions on ‘Project Economics’ and ‘Commercial’ dimensions to gain an overall perspective of the complexity of your project.\";s:6:\"higher\";s:875:\"The initial Technical profile indicates that the organisation does not currently have the requisite capability to deliver this project effectively. You may need to investigate the tools, templates and procedures currently in place, and suggest reviews to improve processes, procedures, and standards to support your project. Although your score indicates a ‘high’ level of initial risk on the ‘Technical’ dimension, you would be required to introduce the required changes and draw on the expertise of others to seek to move to ‘medium’ or ‘low’ risk before you progress to the planning stage. Consider that the ‘Technical’ dimension is only one part in assessing overall ‘Project Complexity’.  Continue answering the questions on ‘Project Economics’ and ‘Commercial’ dimensions to gain an overall perspective of the complexity of your project.\";}','2017-07-06 13:57:53','2017-09-10 09:48:11','risk','true',77,'>94>77>80',75,10031,1005),(81,'Project Economics',NULL,'a:4:{s:4:\"desc\";s:203:\"The Project Economics dimension considers some of the initial business case assumptions that may significantly impact on the financial returns and project benefits realisation in delivery of the project.\";s:5:\"lower\";s:970:\"The initial Project Economics profile of your project indicates that funding, partnerships and resourcing are a relatively low risk area in the context of achieving project objectives. It is likely that the business case has considered the deliverables of the project and secured the appropriate funding to ensure the project can be planned and executed effectively as well realise identified project benefits. If there are any partnerships, they have been secured and resourcing has been sourced appropriately. Since the ‘Project Economics’ aspect of the project appears to be ‘low’ in risk, it is advisable that you consider lessons learnt from previous projects before moving to the planning stage. Consider the ‘Project Economics’ dimension is only one part of assessing overall ‘Project Complexity’. Continue answering the questions on ‘Technical’ and ‘Commercial’ dimensions to gain an overall perspective of the complexity of your project.\";s:6:\"medium\";s:1058:\"The initial Project Economics profile indicates that there are some  issues in the business case that are likely to affect the financial returns and benefits realisation of your project. It is likely that the business case has not received adequate consideration which may lead to issues later if not addressed timeously in the initiation stage. Although there may current be a lack of clarity on funding, partnerships, and/or resourcing, there is sufficient information for you to collate and draw on experts and other resources to lower the ‘Project Economics’ risk. Since the ‘Project Economics’ dimension of the project appears to be of ‘medium’ risk, it is advisable that you revisit the business case and consider lessons learnt from previous projects before moving forward. Consider that the ‘Project Economics’ dimension is only one part of assessing overall ‘Project Complexity’. Continue answering the questions on ‘Technical’ and ‘Commercial’ dimensions to gain an overall perspective of the complexity of your project.\";s:6:\"higher\";s:820:\"The initial Project Economics profile indicates that there is insufficient funding and resourcing to execute the project effectively. Further, it is unlikely that the project will achieve financial returns or realise stated project benefits. You will need to rework or reconsider your business case to carefully assess the feasibility of the project. Although you have scored ‘high’ risk on ‘Project Economics’, you can make changes and draw on the expertise of others to move to ‘medium’ or ‘low’ risk prior to moving into the planning phase. Consider the ‘Project Economics’ dimension is only one part of assessing overall ‘Project Complexity’. Continue answering the questions on ‘Technical’ and ‘Commercial’ dimensions to gain an overall perspective of the complexity of your project.\";}','2017-07-06 13:58:03','2017-09-10 09:48:11','risk','true',77,'>94>77>81',76,10031,1005),(82,'Commercial',NULL,'a:4:{s:4:\"desc\";s:230:\"The Commercial dimension considers a selection of anticipated market conditions, together with other commercial requirements to secure supply of key resources (i.e. goods, materials and labour) to successfully deliver the project.\";s:5:\"lower\";s:734:\"The initial Commercial profile of your project indicates good clarity around deliverables, and an awareness of procurement and contract management systems required to execute the project effectively. It is likely that contractors and suppliers are in place to execute the project. Since the ‘Commercial’ dimension of the project appears to be ‘low’ risk, it is advisable that you consider lessons learnt from previous projects to move forward to the planning stage. Consider the ‘Commercial’ dimension is only one part of assessing overall ‘Project Complexity’. Continue answering the questions on ‘Technical’ and ‘Project Economics’ dimensions to gain an overall perspective of the complexity of your project.\";s:6:\"medium\";s:962:\"The initial Commercial profile of your project indicates there is some level of clarity on the deliverables and some awareness of procurement and contract management support systems within the organisation. It is likely that you have some contracts in place but you will need to implement contract management processes before moving to the next stage. Since the ‘Commercial’ dimension of the project appears to be of ‘medium’ risk, it is advisable that you ensure availability of procurement systems and processes, and understand current market conditions. Also engage with contractors to access their knowledge, and ascertain general resource availability before moving to the planning stage. Consider the ‘Commercial’ dimension is only one part of assessing overall ‘Project Complexity’. Continue answering the questions on ‘Technical’ and ‘Project Economics’ dimensions to gain an overall perspective of the complexity of your project.\";s:6:\"higher\";s:972:\"The initial Commercial profile of your project indicates a lack of clarity on the procurement and contract management systems within your organisation. It is therefore likely that there are insufficient supplier contracts in place to ensure appropriate resourcing and work requirement specification. Although you have scored ‘high’ risk on the ‘Commercial’ dimension, you need to ensure contract management processes and procedures are in place. To ensure a thorough understanding of deliverables of your project, draw on experts with regard to procurement management systems and processes. Investigate the general availability of contractors and suppliers for this type of project before proceeding any further. The ‘Commercial’ dimension is only one part of assessing overall ‘Project Complexity’. Continue answering the questions on ‘Technical’ and ‘Project Economics’ dimensions to gain an overall perspective of the complexity of your project.\";}','2017-07-06 13:58:13','2017-09-10 09:48:11','risk','true',77,'>94>77>82',77,10031,1005),(83,'Project Governance',NULL,'a:4:{s:4:\"desc\";s:264:\"The Project Governance dimension considers the level of regulatory, compliance, and control issues that govern the project. Project governance provides a decision-making assurance framework that should be sufficiently robust to govern and support project delivery.\";s:5:\"lower\";s:886:\"The initial Project Governance profile of your project indicates that your organisation is largely compliant and adheres to regulations around project delivery. Responses suggest that there are appropriate policies and procedures in place to make decisions about the project. It is likely that you are current with all compliance related issues within the organisation, and proceed to the planning stage. Since the ‘Project Governance’ dimension of the project appears to be ‘low’ in risk, it is advisable that you remain current with all regulatory matters of the industry in which your project is situated. The ‘Project Governance’ dimension is only one part of assessing overall ‘Project Environment’. Continue answering the questions on ‘Project Technology’ and ‘Project Location’ dimensions to gain an overall perspective of the environment of your project.\";s:6:\"medium\";s:698:\"The initial Project Governance profile of your project indicates that your organisation is somewhat compliant. It is likely that you will have some decision-making processes in place and that the project objectives are partially aligned to organisational values. It is advised that you draw on others expertise of others within the organisation to ensure appropriate governance is undertaken before moving to the planning stage. The ‘Project Governance’ dimension is only one part of assessing overall ‘Project Environment’. Continue answering the questions on ‘Project Technology’ and ‘Project Location’ dimensions to gain an overall perspective of the environment of your project.\";s:6:\"higher\";s:918:\"The initial Project Governance profile of your project indicates that your organisation does not currently have the necessary governance requirements in place to deliver this project. You may need to investigate the governance structure currently in place, and suggest amendments to improve compliance and governance before moving out of the initiation to the planning stage. Although you have scored ‘high’ risk on Project Governance, you can implement changes to strengthen governance systems. Research equivalent project organisations and seek the knowledge and expertise of others to try to move to a ‘medium’ or ‘low’ risk profile. The ‘Project Governance’ dimension is only one part of assessing overall ‘Project Environment’. Continue answering the questions on ‘Project Technology’ and ‘Project Location’ dimensions to gain an overall perspective of the environment of your project.\";}','2017-07-06 13:58:40','2017-09-10 09:48:04','risk','true',78,'>94>78>83',78,10031,1005),(84,'Project Technology',NULL,'a:4:{s:4:\"desc\";s:160:\"The Project Technology dimension refers to the level of technology, or technological infrastructure complexity that is required for successful project delivery.\";s:5:\"lower\";s:820:\"The initial Project Technology profile indicates that you have sound understanding of the key technology requirements of the project. Additionally, the organisation has sufficient resources, and capability to integrate the requisite technology in the project. Since the ‘Project Technology’ dimension of the project appears to be ‘low’ in risk, it is advisable that you keep up-to-date with technological trends and possible changes in technology between initiation/planning and execution stages to ensure that the capability remains current. The ‘Project Technology’ dimension is only one part of assessing overall ‘Project Environment’. Continue answering the questions on ‘Project Governance’ and ‘Project Location’ dimensions to gain an overall perspective of the environment of your project.\";s:6:\"medium\";s:779:\"The initial Project Technology profile indicates that there are some areas where there is uncertainty about the use and integration of technology in your project. Although there is current lack of clarity on technology, there is sufficient information for you to collate or source and integrate appropriate technology. Since the ‘Project Technology’ dimension appears to be of ‘medium’ risk, it is advisable that you draw on technology experts that can guide you before moving into the planning phase. The ‘Project Technology’ dimension is only one part of assessing overall ‘Project Environment’. Continue answering the questions on ‘Project Governance’ and ‘Project Location’ dimensions to gain an overall perspective of the environment of your project.\";s:6:\"higher\";s:894:\"The initial Project Technology profile indicates that there is insufficient knowledge around the technology required for the project. You will need to rethink your approach to using a particular technology, or outsource the appropriate technology and skills to move the project forward. Although you have scored ‘high’ risk on ‘Project Technology’, you can allocate resources, new technology and draw on the expertise of others to move to ‘medium’ or ‘low’ risk. Do not move out of the initiation stage to the planning stage until you have a greater degree of clarity around the technology requirements. The ‘Project Technology’ dimension is only one dimension of assessing overall ‘Project Environment’. Continue answering the questions on ‘Project Governance’ and ‘Project Location’ dimensions to gain an overall perspective of the environment of your project.\";}','2017-07-06 14:01:37','2017-09-10 09:48:04','risk','true',78,'>94>78>84',79,10031,1005),(85,'Project Location',NULL,'a:4:{s:4:\"desc\";s:221:\"The Project Location dimension considers the geographical location and climatic conditions of the project delivery site, and the level of familiarity with the expected conditions under which the project will be delivered.\";s:5:\"lower\";s:659:\"The initial Project Location profile indicates that you have sufficient knowledge of the location. You appear to be are aware of any local requirements pertaining to the location. Since the ‘Project Location’ dimension of the project appears to be ‘low’ in risk, it is advisable that you consider lessons learnt from previous projects as you move forward to the planning stage. The ‘Project Location’ dimension is only one part of assessing overall ‘Project Environment’. Continue responding to the questions on ‘Project Governance’ and ‘Project Technology’ dimensions to gain an overall perspective of the environment of your project.\";s:6:\"medium\";s:885:\"The initial Project Location profile indicates that you have some clarity regarding project location issues and partial awareness of the requirements in that location. It is likely that you have some knowledge of the location and that you may need to relocate stakeholders to deliver the project. Since the ‘Project Location’ dimension of the project appears to be of ‘medium’ risk, it is advisable that you further research and develop a full understanding of location requirements, climatic conditions as well as any local customs that may impact on project delivery before moving into the planning stage. The ‘Project Location’ dimension is only one part of assessing overall ‘Project Environment’. Continue answering the questions on ‘Project Governance’ and ‘Project Technology’ dimensions to gain an overall perspective of the environment of your project.\";s:6:\"higher\";s:975:\"The initial Project Location profile indicates that you currently have a lack of clarity regarding the project environment, location, and customs. Most likely this is a location you have never delivered a project previously, and need to obtain further clarity regarding skilled resource availability close to the location, otherwise these will need to be moved to the location. Although you have scored ‘high’ risk on ‘Project Location’ dimension, you can improve your understanding of location conditions, by visiting the location, and drawing on local experts, having discussions with locals, contractors and suppliers situated at or near the location, before moving out of the initiation stage. The ‘Project Location’ dimension is only one part of assessing overall ‘Project Environment’. Continue answering the questions on ‘Project Governance’ and ‘Project Technology’ dimensions to gain an overall perspective of the environment of your project.\";}','2017-07-06 14:01:53','2017-09-10 09:48:04','risk','true',78,'>94>78>85',80,10031,1005),(86,'Stakeholder Profiles',NULL,'a:4:{s:4:\"desc\";s:383:\"The Stakeholder Profile dimension considers how stakeholders are classified. Stakeholders are classified as internal or external to your project. Internal stakeholders are considered as within the project organisation. External stakeholders are outside the project organisation. Stakeholder classification will inform the level of stakeholder management involved in project delivery.\";s:5:\"lower\";s:752:\"The initial Project Stakeholder profile indicates that you anticipate your stakeholders to be relatively well aligned with the objectives of your project.  Since the ‘profile’ of stakeholders appears to be ‘low’, it is likely that you are anticipating less time and resources to be applied to maintaining good alignment through the project phases. Reflect on lessons learnt from similar projects in similar locations before proceeding to the planning stage.  The ‘Stakeholder Profile’ dimension is only one part in assessing overall ‘Project Stakeholders’. Continue answering the questions on ‘Stakeholder Communication’ and ‘Stakeholder Engagement’ dimensions to gain an overall perspective of the stakeholders of your project.\";s:6:\"medium\";s:827:\"The initial Project Stakeholder profile indicates that you anticipate your stakeholders to be moderately aligned with the objectives of your project.  Since the ‘profile’ of stakeholders appears to be ‘medium’, it is likely that you may experience some misalignment from your internal and external stakeholders over some of the key issues.  Before moving out of the initiation phase you need to determine whether there are significant areas of possible conflict, and a strategy to address these before you move to the planning stage. The ‘Stakeholder Profile’ dimension is only one part in assessing overall ‘Project Stakeholders’. Continue answering the questions on ‘Stakeholder Communication’ and ‘Stakeholder Engagement’ dimensions to gain an overall perspective of the stakeholders of your project.\";s:6:\"higher\";s:737:\"The initial Project Stakeholder profile indicates that you anticipate your stakeholders to be only marginally aligned with the objectives of your project.  Since the ‘profile’ of stakeholders appears to be ‘high’, it is likely that you may experience greater levels of uncertainty and objection from your stakeholders. Ensure that you understand the differences and how these will be managed and harmonised before moving to the planning stage. The ‘Stakeholder Profile’ dimension is only one part in assessing overall ‘Project Stakeholders’. Continue answering the questions on ‘Stakeholder Communication’ and ‘Stakeholder Engagement’ dimensions to gain an overall perspective of the stakeholders of your project.\";}','2017-07-06 14:02:17','2017-09-10 09:47:57','risk','true',79,'>94>79>86',81,10031,1005),(87,'Stakeholder Communication',NULL,'a:4:{s:4:\"desc\";s:290:\"The Stakeholder Communication dimension is concerned with the level and frequency of communication required with internal and external stakeholders. Developing appropriate and effective communication strategies is essential to ensure stakeholders remain aligned to achieve project outcomes.\";s:5:\"lower\";s:715:\"The initial Stakeholder Communication profile indicates that you may have effective communication strategies in place to communicate with your internal and external stakeholders. Since the ‘Communications’ aspect is ‘low’ risk, you may want to monitor the strategy that is in place to ensure that there is continuous effective communication with both internal and external stakeholders throughout the project life cycle. The ‘Stakeholder Communication’ dimension is only one part of assessing overall ‘Project Stakeholders’. Continue answering the questions on ‘Stakeholder Profiles’ and ‘Stakeholder Engagement’ dimensions to gain an overall perspective of the stakeholders of your project.\";s:6:\"medium\";s:798:\"The initial Stakeholder Communication profile indicates that you may need to adapt your communication strategy. Effective communication with the different stakeholder groups require the development of a robust and integrated communication strategy. Since the ‘Stakeholder Communication’ aspect of the project appears to be of ‘medium’ risk, it is advisable that you reconsider your communication strategies with each key stakeholder group, considering lessons learnt before moving to the planning stage. The ‘Stakeholder Communication’ dimension is only one part of assessing overall ‘Project Stakeholders’. Continue answering the questions on ‘Stakeholder Profiles’ and ‘Stakeholder Engagement’ dimensions to gain an overall perspective of the stakeholders of your project.\";s:6:\"higher\";s:677:\"The initial Stakeholder Communication profile indicates that the   current communication strategy is either an insufficient or ineffective to communicate with your stakeholders. You will need to develop a new integrated communication strategy, or reconsider your current strategy to ensure that you can regularly communicate with your stakeholders before moving out of the initiation stage. The ‘Stakeholder Communication’ dimension is only one part of assessing overall ‘Project Stakeholders’. Continue answering the questions on ‘Stakeholder Profiles’ and ‘Stakeholder Engagement’ dimensions to gain an overall perspective of the stakeholders of your project.\";}','2017-07-06 14:02:27','2017-09-10 09:47:57','risk','true',79,'>94>79>87',82,10031,1005),(88,'Stakeholder Engagement',NULL,'a:4:{s:4:\"desc\";s:307:\"The Stakeholder Engagement dimension refers to the level of interest, and level of influence that your stakeholders may have on achieving your project objectives, and your ability to pro-actively plan and manage the engagement. Dynamic stakeholder engagement is key to ensure project outcomes are delivered.\";s:5:\"lower\";s:753:\"The initial Stakeholder Engagement profile indicates that your stakeholders are interested in, and have impact on the project outcomes. Further, it appears that internal and external stakeholders support the project rather than pose challenges to project delivery. Since the ‘Stakeholder Engagement’ aspect of the project appears to be ‘low’ in risk, it is advisable that you consider lessons learnt from previous projects before moving to the planning stage. The ‘Stakeholder Engagement’ dimension is only one part of assessing overall ‘Project Stakeholders’. Continue answering the questions on ‘Stakeholder Profiles’ and ‘Stakeholder Communication’ dimensions to gain an overall perspective of the environment of your project.\";s:6:\"medium\";s:982:\"The initial Stakeholder Engagement profile indicates that you may experience varying levels of engagement and some uncertainty from your stakeholders. It is likely that you have some idea about how the stakeholders are likely to respond to the project. You will need to be clear on their level of interest and their ability to adversely influence project outcomes and ensure responsive strategies to pro-actively manage resistance from both internal and external stakeholders. Since the ‘Stakeholder Engagement’ aspect of the project stakeholders appears to be of ‘medium’, it is advisable that you meet with stakeholders to secure their input and support before moving to planning stage. The ‘Stakeholder Engagement’ dimension is only one part of assessing overall ‘Project Stakeholders’. Continue answering the questions on ‘Stakeholder Profiles’ and ‘Stakeholder Communication’ dimensions to gain an overall perspective of the environment of your project.\";s:6:\"higher\";s:867:\"The initial Stakeholder Engagement profile indicates that you may experience varying levels of engagement from your stakeholders. Stakeholders who agitate and have influence over project outcomes are a threat to your project. If either internal or external stakeholders pose significant challenges to project delivery, you will not be able to move forward until you have gained a complete understanding of their motivations.  To do this, you need to draw on experts and engage with key project stakeholders to ascertain their level of interest and influence over project outcomes.  The ‘Stakeholder Engagement’ dimension is only one part of assessing overall ‘Project Stakeholders’. Continue answering the questions on ‘Stakeholder Profiles’ and ‘Stakeholder Communication’ dimensions to gain an overall perspective of the environment of your project.\";}','2017-07-06 14:02:47','2017-09-10 09:47:57','risk','true',79,'>94>79>88',83,10031,1005),(94,'Overall',NULL,'a:4:{s:4:\"desc\";s:7:\"Overall\";s:5:\"lower\";s:0:\"\";s:6:\"medium\";s:0:\"\";s:6:\"higher\";s:0:\"\";}				','2017-09-10 09:47:42','2017-09-10 09:47:43','risk','true',0,'>94',84,10031,1005),(95,'Overall',NULL,'a:4:{s:4:\"desc\";s:7:\"Overall\";s:5:\"lower\";s:0:\"\";s:6:\"medium\";s:0:\"\";s:6:\"higher\";s:0:\"\";}','2017-09-10 09:52:49','2017-09-10 09:52:50','raw','true',0,'>95',85,10030,1006),(37,'Economic',NULL,'a:2:{s:5:\"lower\";s:402:\"The economy can play a major role in influencing behaviour of industries (and competitors within those industries). Interest rates, inflation, foreign exchange rates, trade and budget surplus/deficit, growth in GDP, etc., are all indicators of economic health and a regular analysis of the macroeconomic environment can pick up early indication of trends/changes that may adversely impact the business.\";s:6:\"higher\";s:445:\"The economic state has a strong influence on the behaviour of industries (and competitors within those industries). Indicators of the level of economic health include interest rates, inflation, foreign exchange rates, trade and budget surplus/deficit, growth in GDP, etc. Regular analysis of the macroeconomic environment helps to identify early indication of negative trends/changes to allow time to minimize any serious impact to the business.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',34,'>95>34>37',103,10030,1006),(36,'Government / Regulatory',NULL,'a:2:{s:5:\"lower\";s:379:\"Higher levels of sensitivity to political, legal and regulatory changes may inhibit the freedom a business enjoys in conducting its activities. A careful watch needs to be undertaken regularly to look for any impending changes at all levels of law, government and politics, for example, emergent environmental protection laws or increasing powers of consumer regulatory agencies.\";s:6:\"higher\";s:334:\"Minimal levels of sensitivity to political, legal and regulatory changes enable greater freedom for a business to conduct its activities. That said, a regular environmental scan may alert and enable the team to react proactively to any impending legal, government or political changes that may have implications for the business. \r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',34,'>95>34>36',102,10030,1006),(34,'Environment',NULL,'a:2:{s:5:\"lower\";s:480:\"Scanning the environment plays a crucial role in evaluating the opportunity. Though there is no guarantee for success, thorough preparation by the entrepreneur will provide market insights, industry knowledge and competitive intelligence that can provide a leg up on competitors. Ignoring the influence and impact that environmental factors (political, government, economic, social/cultural, legal, institutional, etc.) can have on a fledgling venture is done at one’s peril.   \";s:6:\"higher\";s:496:\"You have ascertained that the opportunity shows compatibility with a number of environmental factors (political, government, economic, social/cultural, legal, institutional, etc.). Continual scanning of and sensitivity to these factors is crucial as this alerts the entrepreneurial team to impending difficulties or complications with sufficient time to manage the issue. Or, alternatively, the team is able to identify potential new opportunities and captialise on them prior to the competition.\";}','2017-09-10 13:07:09','2017-09-24 15:53:19','raw','true',95,'>95>34',4,10030,1006),(22,'Financial',NULL,'a:2:{s:5:\"lower\";s:155:\"A lack of functional leadership skills within the team will impact team cohesion and reduce your ability to make informed and measured business decisions. \";s:6:\"higher\";s:236:\"A functional and effective team is led by a lead entrepreneur who instills a solid understanding in each member that a successful business depends upon strong team cohesion, motivation and ownership of individual areas of expertise.\r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',32,'>95>32>22',99,10030,1006),(21,'Business Planning',NULL,'a:2:{s:5:\"lower\";s:281:\"lack of previous entrepreneurial or corporate business experience may hinder your ability to effectively resource and efficiently manage the startup requirements. It may be in your interests to make use of external resources and mentoring relationships to help you bridge this gap.\";s:6:\"higher\";s:183:\"Previous business experience, whether entrepreneurial or corporate, will facilitate sound management of the day to day operations required to build a viable and sustainable business. \";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',32,'>95>32>21',98,10030,1006),(20,'External People',NULL,'a:2:{s:5:\"lower\";s:217:\"A lack of prior entrepreneurial skill and experience limits the resilience required to push through the challenges of starting and running a business. Usage of external professionals may assist where skills gaps exist\";s:6:\"higher\";s:200:\"Prior entrepreneurial experience and usage of external professionals when required provides a resilience and focus to rise and meet challenges that will occur during the startup and growth phases.\r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',32,'>95>32>20',97,10030,1006),(19,'Bootstrapping',NULL,'a:2:{s:5:\"lower\";s:292:\"Entrepreneurial teams indicate a lack of investor readiness through not being able to demonstrate a strong, repeatable and scalable business model. This is exacerbated by not being able to prove their competence, commitment and ability to share control as they negotiate for equity funding.  \";s:6:\"higher\";s:254:\"Teams must validate their business idea by demonstrating to investors there is a strong, repeatable and scalable business model. The team must also prove their competence, commitment and ability to share control as they negotiate for equity funding. \r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',32,'>95>32>19',96,10030,1006),(32,'Resources',NULL,'a:2:{s:5:\"lower\";s:567:\"Unfortunately this is where numerous entrepreneurs make fundamental errors the first time around. Many entrepreneurs want to retain control of everything, but most often you reach a point where you need to trust others and allocate jobs and roles accordingly.  This approach enables you to focus on the bigger picture of growing the business rather than being bogged down in the everyday operations. Focusing on strategy development and determining whether you have the relevant resources to deliver the product/service will facilitate the ability to grow and scale. \";s:6:\"higher\";s:485:\"You recognise that ability to access markets and reach your specified customers is crucial. You have identified key resources to enable this, and understand that employing valuable human capital and securing relevant funding will impact significantly on the growth potential of the business. Appropriate “talent” (employees) are a critical resource to build the business. Access to suitable debt or equity capital are also key resources to enable a company to grow and scale.  \r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 15:53:19','raw','true',95,'>95>32',3,10030,1006),(29,'Balance & Integrity',NULL,'a:2:{s:5:\"lower\";s:178:\"Without a clear purpose, structure and conviction of the objectives, inconsistent team attitudes and values can impair business performance and negatively affect venture growth. \";s:6:\"higher\";s:228:\"Clear purpose and structure engenders a resilient psychological balance among team members. A rational and motivated team understand that cohesion and integrity underpin the effectiveness and efficiency of business performance. \";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',31,'>95>31>29',95,10030,1006),(27,'Functional Skills',NULL,'a:2:{s:5:\"lower\";s:281:\"Lack of previous entrepreneurial or corporate business experience may hinder your ability to effectively resource and efficiently manage the startup requirements. It may be in your interests to make use of external resources and mentoring relationships to help you bridge this gap.\";s:6:\"higher\";s:182:\"Previous business experience, whether entrepreneurial or corporate, will facilitate sound management of the day to day operations required to build a viable and sustainable business.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',31,'>95>31>27',94,10030,1006),(28,'Leadership Skills',NULL,'a:2:{s:5:\"lower\";s:155:\"A lack of functional leadership skills within the team will impact team cohesion and reduce your ability to make informed and measured business decisions. \";s:6:\"higher\";s:236:\"A functional and effective team is led by a lead entrepreneur who instills a solid understanding in each member that a successful business depends upon strong team cohesion, motivation and ownership of individual areas of expertise.\r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',31,'>95>31>28',93,10030,1006),(26,'Entrepreneurial Skills',NULL,'a:2:{s:5:\"lower\";s:150:\"A lack of prior entrepreneurial skill and experience limits the resilience required to push through the challenges of starting and running a business.\";s:6:\"higher\";s:142:\"Prior entrepreneurial experience provides a resilience and focus to rise and meet the challenges that will occur during the startup phase.\r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',31,'>95>31>26',92,10030,1006),(25,'Investor Readiness',NULL,'a:2:{s:5:\"lower\";s:297:\"Entrepreneurial teams indicate a lack of investor readiness through not being able to demonstrate a strong, repeatable and scalable business model. This is exacerbated if the team is unable to evidence their competence, commitment and ability to share control as they negotiate for equity funding.\";s:6:\"higher\";s:280:\"Teams are able to validate their business opportunity by demonstrating to investors there is a strong, repeatable and scalable business model. The team must also prove their competence, commitment and ability to share control if they wish to seek and negotiate for equity funding.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',31,'>95>31>25',91,10030,1006),(31,'Team',NULL,'a:2:{s:5:\"lower\";s:328:\"Understanding the importance and value of a great team and how to develop a complementary and cohesive team are important leadership skills. Teams require a mix of diverse skills that go beyond the scope of any one individual. Attempting to operate individually may impact negatively on the success of your potential opportunity\";s:6:\"higher\";s:296:\"Great teams are essential for high performance in any business. Each member brings specific complementary skills, capabilities and experience to the team. This expertise is directed towards a shared purpose and attaining common goals through coordinated roles and in cooperation with each other. \";}','2017-09-10 13:07:09','2017-09-24 15:53:19','raw','true',95,'>95>31',2,10030,1006),(16,'Harvestability',NULL,'a:2:{s:5:\"lower\";s:182:\"With no defined exit strategy options, the business appears to lack strategic planning and goals that will help to promote long term growth and resilient, sustainable profitability. \";s:6:\"higher\";s:243:\"The business clearly understands the importance of exit strategy options and how this affects strategic planning, financial projection and the need to invest in growing the business to ensure a solid capital gain if the opportunity presents.\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',35,'>95>35>16',90,10030,1006),(23,'Legal/Contractual',NULL,'a:2:{s:5:\"lower\";s:214:\"You may want to review the proprietary aspects of your business since it appears that your Business is easily imitable by competitors. No proprietary protection leaves your business at a competitive disadvantage.  \";s:6:\"higher\";s:208:\"Having strong proprietary protection (in terms of trade marks, patents, registered designs, etc.) makes it more difficult for competitors to compete effectively against you and raises barrier to market entry.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',12,'>95>35>12>23',117,10030,1006),(24,'Financial Performance',NULL,'a:2:{s:5:\"lower\";s:455:\"Poor financial performance is indicated by disproportionate capital investment, elevated level of working capital, poor sales growth, low percentage of after tax profit, a long breakeven period, low internal rate of return and the inability to generate an early positive cash flow.  The business needs to look more keenly at measures of financial performance and use this data to improve opportunity potential, growth and longer term sustainability.      \";s:6:\"higher\";s:482:\"Achievement of a higher score demonstrates that financial performance is monitored regularly to ensure capital investment and working capital levels are adequate, sales growth is healthy, percentage of after tax profit reflects steady profitability, and that cash flow remains positive. A business that does not take its eye off financial performance is in a better position to quickly identify and act upon both positive and negative factors in the business, environment or market.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',35,'>95>35>24',89,10030,1006),(17,'Research & Development',NULL,'a:2:{s:5:\"lower\";s:305:\"Lack of an R&D strategy/program makes it easier for competitors suggests that your business may not be developing an innovation capability making it easier for competitors to displace you. If your R&D is costly, it may be worthwhile to consider alternatives such as to outsource or off-shore the function.\";s:6:\"higher\";s:289:\"You are developing an innovative culture and/or product range which will make it difficult for competitors to imitate. This may increase the value of the business through a developing a more significant intellectual propriety (IP) base. This also suggests current R&D costs are manageable.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',12,'>95>35>12>17',116,10030,1006),(18,'Barriers to Entry/Exit',NULL,'a:2:{s:5:\"lower\";s:389:\"The low range achieved suggests that it may be possible for competitors to enter the market relatively quickly after your entry, capital costs are on the high side, your business is built around more generic skills (a positive as you are not paying a premium for specialist skills) which means your business may be less differentiated. Plus, transportation method/costs may require review.\";s:6:\"higher\";s:327:\"A higher score infers that you have an advantage of entering the market well before competitors can, your capital and/or transportation costs are able to managed, your specialist skills will facilitate differentiating the business, but note that specialist skills may attract a premium price and thus diminish your margin. \r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',12,'>95>35>12>18',115,10030,1006),(15,'Strategic Partnerships',NULL,'a:2:{s:5:\"lower\";s:388:\"A poor score with strategic partnerships implies insufficient attention has been given to using or increasing the number/range of endorsements of third parties and/or strategic alliances, and that you may be beholden to a limited number of suppliers who may be in a position to dictate price/supply. In addition, your business may be at risk through use of limited distribution channels. \";s:6:\"higher\";s:401:\"A higher score for strategic partnerships implies you pay satisfactory attention to using a number/range of third party endorsements and/or strategic alliances to provide business credibility. Not being beholden to a limited number of suppliers means it is unlikely you will have price or supply dictated to you. In addition, you reduce business risk through use of a number of distribution channels. \";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',12,'>95>35>12>15',114,10030,1006),(14,'Product Differentiation',NULL,'a:2:{s:5:\"lower\";s:239:\"A lower range in product differentiation suggests you need to address reasons for poor customer satisfaction, reduce the current number of intermediaries used, and improve your differentiation with competing products in your target market.\";s:6:\"higher\";s:232:\"An above average range reflects you strategically managing customer satisfaction, retaining control of the distribution channel, and ensuring your products are well-differentiated above competing products within your target market. \";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',12,'>95>35>12>14',113,10030,1006),(13,'Production  Issues',NULL,'a:2:{s:5:\"lower\";s:305:\"Achieving a lower range in production issues intimates that you need to review one or more of the following: costs of production, ability to scale up, aiming to achieve lower inventory levels, reduction in raw material/labour costs, and targeting higher levels of product and/or technological innovation. \";s:6:\"higher\";s:364:\"Your current range suggests you are hitting the mark when it comes to being a low cost producer, able to scale up production processes, maintain lower inventory levels, have a reduced raw material/labour cost, and reflect adequate product and/or technological innovation. Note that entrepreneurial ventures are dynamic and processes should be reviewed continually.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',12,'>95>35>12>13',112,10030,1006),(12,'Sustainable Competitive Adv.',NULL,'a:2:{s:5:\"lower\";s:382:\"A lack of appreciation of the importance of how strong leadership, efficient human capital management, an embedded culture, strategic partnerships, robust systems and R&D collectively create a flexible and proactive business. Without these competencies the company will struggle to build unique resources and capabilities that can be leveraged to generate new market opportunities. \";s:6:\"higher\";s:320:\"The business understands that strong leadership, efficient human capital management, an embedded culture, strategic partnerships, robust systems and R&D collectively create a flexible and proactive business, adept at building unique resources and capabilities that can be leveraged to generate new market opportunities. \";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',35,'>95>35>12',88,10030,1006),(11,'Process',NULL,'a:2:{s:5:\"lower\";s:204:\"A complex production process, poor control over the quality of inputs and specialised storage requirements removes power from the hands of the business in relation to better managing gross profit margins.\";s:6:\"higher\";s:213:\"A simplified production process, control over the quality of inputs and standard uncomplicated storage requirements puts more power in the hands of the business in relation to better managing gross profit margins.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',9,'>95>35>9>11',111,10030,1006),(30,'Team, Resources and Opp',NULL,'a:2:{s:5:\"lower\";s:276:\"There will always be some weakness in any business model, so it is important to modify identified weaknesses through a continual adjustment process to produce the best fit between team, resources and opportunity that will match the needs of the customer over your competition.\";s:6:\"higher\";s:282:\"There will always be some weakness in any business model, so it is important to modify identified weaknesses through a continual adjustment process to produce the best fit between team, resources and opportunity that will match the needs of the customer over your competition.  \r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',9,'>95>35>9>30',110,10030,1006),(10,'Product Characteristics',NULL,'a:2:{s:5:\"lower\";s:264:\"A lack of understanding how customers use and/or benefit from specific product characteristics can negatively impact product performance, increase costs through a dependence on suppliers, and open unwanted competition for substitute products in the target market. \";s:6:\"higher\";s:237:\"Deep understanding how customers use and benefit from product characteristics can improve product performance, cut costs through use of multiple suppliers, and create competitive advantage over substitute products in the target market.  \";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',9,'>95>35>9>10',109,10030,1006),(9,'Product',NULL,'a:2:{s:5:\"lower\";s:317:\"A single non-unique product reduces accessibility to the market. Rather than full development of an untested product, experiment with early prototype product/s to gain important feedback from customers that will help guide design and features/benefits to include in the next iteration of the product or product range.\";s:6:\"higher\";s:242:\"Business has a strong understanding of the importance of customer in product development to gauge relevance of value proposition, importance of product benefits, market acceptance of pricing, and appropriateness of distribution channels. \r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',35,'>95>35>9',87,10030,1006),(5,'Customers',NULL,'a:2:{s:5:\"lower\";s:178:\"Research your marketplace and your target markets to gain valuable insights into meeting customer expectations. Failing to do so and customers will take their business elsewhere.\";s:6:\"higher\";s:139:\"Exceeding customer expectations generates customer delight which translates into long-term customer loyalty and increased brand reputation.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',1,'>95>35>1>5',108,10030,1006),(6,'Pricing',NULL,'a:2:{s:5:\"lower\";s:186:\"Remember to consider marketing and distribution costs when setting your price. If you set your price too low any fluctuations in the market cannot be accommodated with price elasticity. \";s:6:\"higher\";s:189:\"A well differentiated product/service enables you to be a price setter, which suggests that if you efficiently manage costs you will be in a position to generate higher profit margins. \r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',1,'>95>35>1>6',107,10030,1006),(4,'Competitors',NULL,'a:2:{s:5:\"lower\";s:339:\"Little to no competitive analysis undertaken leaves you in the dark regarding the market and your competition. It is a sign of poor management.  Competitive analysis enables the business to anticipate changes in the market and proactively obstruct competition from encroaching on your market share or the ability to affect product pricing.\";s:6:\"higher\";s:350:\"A high score indicates that the venture has a strong understanding of the competitive landscape before entering the market. Your competitive analysis provides knowledge of competitor strengths and weaknesses, the incumbent position in the market, and which competitors will take consequential action to new entries or activity within the marketplace.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',1,'>95>35>1>4',106,10030,1006),(3,'Market Structure',NULL,'a:2:{s:5:\"lower\";s:365:\"If the window of opportunity is closing, changes in the market may force the business into unwanted or risky situations unless the company is able to innovate or differentiate within the service or product range. Companies in crowded markets with a high reliance on other products hold a weaker position and increase their level of vulnerability and risk involved. \";s:6:\"higher\";s:334:\"The decision to enter the market as a specialist or generalist is easier if selecting a market segment that is not saturated. This decision determines the product domain, steers resource deployment and influences longer term development through a focused/niche strategy or rapid building of market share to gain superior performance. \";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',1,'>95>35>1>3',105,10030,1006),(1,'Target Market',NULL,'a:2:{s:5:\"lower\";s:409:\"A static market (small market with little or no growth prospects) is typically fiercely competitive. Where the target market is small, this will significantly impact the ability to develop a viable growth-oriented business. Even where high growth potential is not the goal, though a smaller target market may enable creation of a lifestyle business, future growth potential will be still likely be curtailed. \";s:6:\"higher\";s:185:\"Current market size and structure signifies strong potential for future growth. A growing market is indicative of longer-term viability and capacity to increase future market share.\r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',35,'>95>35>1',86,10030,1006),(2,'Target Market Size',NULL,'a:2:{s:5:\"lower\";s:450:\"A low score for market potential, size and growth rate does not necessarily infer there is no opportunity, but rather that it may be short lived.  Minimal market share in a small market puts the company in a vulnerable position and may mean the business will be operating in a market that is too small for the company to remain durable over the longer term, with little opportunity to increase market share in the domestic or international markets.  \";s:6:\"higher\";s:209:\"A high score for market potential, size and growth rate is a strong indicator of growth potential for new entrants to the market, with capacity to grow domestic market share and enter international markets.   \";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',1,'>95>35>1>2',104,10030,1006),(35,'Opportunity',NULL,'a:2:{s:5:\"lower\";s:718:\"A number of important factors must line up for an opportunity to have the best chance of success. If the key factors don’t align in a particular time frame, it may be better to pass or revisit the opportunity when alignment of factors is more tightly coordinated. If there is evidence the need is already being met, you must determine whether the business you plan to build can address the opportunity with greater capability and more efficiency to be able to enter the market and compete effectively. Continuing to monitor the market and undertaking additional research will enable you to be ready to start when the timing does line up, or identify whether the window for the opportunity has in fact already passed.\";s:6:\"higher\";s:285:\"There is real need for your product or service.  The market is growing and you have identified a niche/gap that you can access and competently service.   Your product/service solves a tangible problem for consumers and your market research evidences that there is strong early demand. \";}','2017-09-10 13:07:09','2017-09-24 15:53:19','raw','true',95,'>95>35',1,10030,1006),(38,'Social & Attitudinal',NULL,'a:2:{s:5:\"lower\";s:368:\"Not reacting to changes in social and attitudinal factors can be a costly mistake, e.g. sales of product and revenues earned. Conducting market research is a critical step in determining trends/patterns that impact consumer attitudes and lifestyle changes. This will help identify possible marketing strategy faults, but may also identify potential new opportunities. \";s:6:\"higher\";s:342:\"A score in this range indicates you understand the importance of conducting market research to produce products/services that benefit people’s lifestyle and complement customers’ behavior. This research helps avoid costly mistakes such as loss of market share or a decline in demand, but may also identify potential new opportunities.\r\n\r\n\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',34,'>95>34>38',101,10030,1006),(39,'Technological',NULL,'a:2:{s:5:\"lower\";s:242:\"Technological innovations can have cost implications in the production of products/services. The level to which technology is embraced or avoided may determine whether technological advances may create potential costly threats for a business.\";s:6:\"higher\";s:267:\"Keeping well-informed of technological innovations reduces the likelihood of cost implications in the production of products/services. The level to which technology is embraced may diminish technological advances from creating potential costly threats for a business.\";}','2017-09-10 13:07:09','2017-09-24 16:02:45','raw','true',34,'>95>34>39',100,10030,1006);
