INSERT INTO `ninety_question` VALUES (10346,'Question 1','risk','a:7:{s:8:\"question\";s:99:\"Does the project require the use of any standard technology that is unfamiliar to the organisation?\";s:6:\"global\";s:1:\"1\";s:4:\"desc\";s:0:\"\";s:5:\"lower\";s:76:\"The use of unfamiliar technology poses minimal risk to your project success.\";s:6:\"medium\";s:174:\"The use of unfamiliar technology poses a possible risk to project success. Ensure relevant team members are sufficiently trained before the use of the technology is required.\";s:6:\"higher\";s:186:\"The use of unfamiliar technology can cause delays and poses a risk to project success. Ensure relevant team members are sufficiently trained before the use of the technology is required.\";s:7:\"answers\";a:3:{i:0;a:4:{s:5:\"alias\";s:2:\"no\";s:5:\"title\";s:2:\"No\";s:5:\"score\";s:1:\"0\";s:4:\"desc\";s:0:\"\";}i:1;a:4:{s:5:\"alias\";s:4:\"some\";s:5:\"title\";s:4:\"Some\";s:5:\"score\";s:1:\"1\";s:4:\"desc\";s:0:\"\";}i:2;a:4:{s:5:\"alias\";s:3:\"yes\";s:5:\"title\";s:3:\"Yes\";s:5:\"score\";s:1:\"2\";s:4:\"desc\";s:0:\"\";}}}','2017-08-16 00:36:46','2017-09-20 21:04:32','true',84,32,'the-project-budget',10018,1005),(10345,'Question 2','risk','a:7:{s:8:\"question\";s:77:\"Is there new (cutting edge or first adopter) technology required for project?\";s:6:\"global\";s:1:\"1\";s:4:\"desc\";s:0:\"\";s:5:\"lower\";s:65:\"Use of new technology poses minimal risk to your project success.\";s:6:\"medium\";s:252:\"Use of new technology could cause delays or project failures. Ensure relevant team members are sufficiently trained before the use of the technology is required. Have a contingency plan for a replacement process if the new technology is not successful.\";s:6:\"higher\";s:251:\"Use of new technology can cause delays and project failures. Ensure relevant team members are sufficiently trained before the use of the technology is required. Have a contingency plan for a replacement process if the new technology