 for growth?\";s:5:\"lower\";s:172:\"Equity funding infers you are placing a priority on growth. Neglecting to project future funding requirements suggests that resourcing a growth strategy will be difficult. \";s:6:\"higher\";s:146:\"The right financing strategy can deliver stability, security and long term profits which are key elements that underpin a reliable growth strategy\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Partially\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}','2017-09-10 13:07:09',NULL,'true',22,1,NULL,10030,1006),(215,'Current Financial Needs','raw','a:5:{s:8:\"question\";s:61:\"Has the company identified both debt and equity requirements?\";s:5:\"lower\";s:195:\"It is important to strike the right balance between debt and equity as a high debt to equity ratio infers that the business will be unable to generate enough cash to satisfy its debt obligations.\";s:6:\"higher\";s:207:\"Well-balanced funding requirements are beneficial to the business as lenders and investors prefer a lower debt to equity ratio because their interests are better protected in the event of a business decline.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Partially\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}','2017-09-10 13:07:09',NULL,'true',22,1,NULL,10030,1006),(220,'Plan Developed by Team','raw','a:5:{s:8:\"question\";s:44:\"Was the business plan developed by the team?\";s:5:\"lower\";s:234:\"A plan developed by external consultants rather than the team may provide a blueprint to guide the business, but it will not adequately engage the team members nor provide the depth of insight required to run the business successfully\";s:6:\"higher\";s:286:\"Team members who research and compile their own business plan gain important in-depth insights into all internal and external components of the business. This knowledge and ability to pivot and adapt the goals, objectives and strategies with simplicity make the plan a living document. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"A Consultant\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:18:\"Minimal Assistance\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:20:\"Team with Assistance\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:26:\"With External Stakeholders\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\"The Team Alone\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}','2017-09-10 13:07:09',NULL,'true',21,1,NULL,10030,1006),(219,'Strategy Congruence','raw','a:5:{s:8:\"question\";s:61:\"Do the financials correlate to the rest of the business plan?\";s:5:\"lower\";s:276:\"The financial section of a business plan is one of the most essential components of the plan and is critical for successfully steering your business forward. Without a realistic and credible financial plan you will find it difficult to obtain investor funding or a bank loan. \";s:6:\"higher\";s:297:\"The financial section of your business plan is only valuable when it is realistic, credible and fully correlates to the remainder of the plan.  A defensible financial plan is essential for successfully steering your business forward, and is crucial if you seek investor funding or a bank loan.\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:11:\"Selectively\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:18:\"Strong Correlation\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}','2017-09-10 13:07:09',NULL,'true',21,1,NULL,10030,1006),(218,'Marketing Strategy Addressed','raw','a:5:{s:8:\"question\";s:96:\"Are the 4 P\'s of marketing; Price, Place Product and Promotion addressed adequately in the plan?\";s:5:\"lower\";s:196:\"Marketing tells people about your product, service, and company and is responsible for generating demand and sales leads. A poorly addressed marketing strategy will severely limit growth in sales.\";s:6:\"higher\";s:245:\"A thorough marketing strategy will use customer feedback to refine and prioritize product features, gain insight into the correct pricing model, and facilitate long-term customer relationships, as well as meet investor’s marketing requirements\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Vaguely\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:10:\"Summarised\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\"Detailed Fully\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}','2017-09-10 13:07:09',NULL,'true',21,1,NULL,10030,1006),(217,'Business Plan','raw','a:5:{s:8:\"question\";s:33:\"Is there a current business plan?\";s:5:\"lower\";s:181:\"Little to no business planning provides poor clarity on start-up direction or future vision and goals to reach for. Poor planning can be detrimental to the viability of the business\";s:6:\"higher\";s:288:\"Efforts put into business planning generate an in-depth knowledge of the business and its environment, and enables the factoring of future growth and direction and to plan for changes in the market, growing or slowing trends, and new innovations or directions to take as the company grows\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:13:\"Exec. Summary\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:10:\"Incomplete\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"Partial\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}','2017-09-10 13:07:09',NULL,'true',21,1,NULL,10030,1006),(1078,'External Contractors','raw','a:5:{s:8:\"question\";s:55:\"Does the business rely heavily on external contractors?\";s:5:\"lower\";s:135:\"Heavy reliance on external contractors indicates vulnerability should the contractor not meet their obligations or their business fails\";s:6:\"higher\";s:257:\"Non-reliance on external contractors suggests you utilise these resources in a savvy way to bring in specialist knowledge/skills on an as needs basis. This approach reduces the risk element of relying on too many third parties in day to day operations. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:14:\"As Need Arises\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:18:\"On a Regular Basis\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}','2017-09-10 13:07:09',NULL,'true',20,1,NULL,10030,1006),(508,'Future Support','raw','a:5:{s:8:\"question\";s:101:\"Does the Company propose to utilise external consultants to support its activities where appropriate?\";s:5:\"lower\";s:145:\"External professional consultants add value to your business by giving you the freedom to outsource essential skills and knowledge on your terms \";s:6:\"higher\";s:195:\"Through using external professional consultants you bring greater insight and knowledge into the business, and expand access into new networks, plus reduce staffing costs improving cash flow \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:14:\"As Need Arises\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:10:\"Frequently\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:16:\"On Regular Basis\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}','2017-09-10 13:07:09