:5;}}s:6:\"global\";i:4;}','2017-09-10 13:07:09',NULL,'true',19,1,NULL,10030,1006),(506,'Ability to bootstrap the business','raw','a:5:{s:8:\"question\";s:50:\"Is it too early to seek professional equity funds?\";s:5:\"lower\";s:154:\"Inability to demonstrate ability to bootstrap in the early phases of the venture suggests the venture may experience difficulty in sourcing equity funding\";s:6:\"higher\";s:230:\"Bootstrapping conducted to grow the business increases the value of the company, proves the business model and competence of the team, and demonstrates the business is ready to source and manage equity funding for growth purposes.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}','2017-09-10 13:07:09',NULL,'true',19,1,NULL,10030,1006),(505,'Historical Record','raw','a:5:{s:8:\"question\";s:43:\"Has the business a record of bootstrapping?\";s:5:\"lower\";s:151:\"Bootstrapping can create a level of financial risk if it does not provide enough investment for the company to become successful at a reasonable rate. \";s:6:\"higher\";s:259:\"Prudent bootstrapping enables the entrepreneurial team to maintain early control over all decisions. It also has capacity to enables greater value to be built into the business prior to seeking outside investment which can mean postponing dilution of equity. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}','2017-09-10 13:07:09',NULL,'true',19,1,NULL,10030,1006),(290,'