iness to reach customers efficiently and effectively\";s:6:\"higher\";s:168:\"Knowledge of the critical success factors for an industry enables a business to better understand and react to market trends and better service their customer segments \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"No Knowledge\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:17:\"Minimal Knowledge\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:14:\"Some Knowledge\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:15:\"Sound Knowledge\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:19:\"Extensive Knowledge\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}','2017-09-10 13:07:09',NULL,'true',27,1,NULL,10030,1006),(275,'Marketing Instinct and Ability','raw','a:5:{s:8:\"question\";s:56:\"How strong is the team\'s marketing instinct and ability?\";s:5:\"lower\";s:183:\"Poor marketing skills and abilities can reduce your ability to actively promote and market what could be a great business thus alienating the business from potential customer segments\";s:6:\"higher\";s:177:\"The ability to deliver Insight-powered marketing and performance can provide insights into consumer experiences that can i9nduce customer loyalty and produce avenues for growth.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"No Experience\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:16:\"Minor Experience\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:19:\"Selected Experience\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:16:\"Sound Experience\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:20:\"Extensive Experience\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}','2017-09-10 13:07:09',NULL,'true',26,1,NULL,10030,1006),(274,'Entrepreneurial History','raw','a:5:{s:8:\"question\";s:52:\"How strong is the team\'s entrepreneurial experience?\";s:5:\"lower\";s:127:\"Poor entrepreneurship skills and lack of business experience will affect the likelihood of the entrepreneurial team’s success\";s:6:\"higher\";s:105:\"Extensive business and entrep