s with a sense of confidence in the entrepreneur and that the entrepreneur has enough invested in the business to ensure financial success is Adequate entrepreneur funding indicates a strong knowledge of the business and the industry, providing investors with a sense of confidence in the entrepreneur and that the entrepreneur has enough invested in the business to ensure financial success is achieved\r\n\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"None Invested\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:9:\"Time Only\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:27:\"Significant Time, Some Cash\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:25:\"Significant Time and Cash\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:10:\"Everything\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}','2017-09-10 13:07:09',NULL,'true',25,1,NULL,10030,1006),(268,'Equity','raw','a:5:{s:8:\"question\";s:62:\"Does the entrepreneur accept their equity is being diminished?\";s:5:\"lower\";s:181:\"Unless the equity in the business is producing dividends each year, it has little value, therefore it is important to accept equity is being diminished for the good of the business.\";s:6:\"higher\";s:181:\"Relinquishing equity can progress growth of your business into new markets. Giving up or selling equity is crucial to attracting the right talent and resources into the business\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:33:\"Not Prepared to Accept Diminution\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:30:\"Not Addressed in Business Plan\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:38:\"Superficial Reference in Business Plan\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:36:\"Somewhat Referenced in Business Plan\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:15:\"Full Acceptance\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}','2017-09-10 13:07:09',NULL,'true',25,1,NULL,10030,1006),(267,'Control','raw','a:5:{s:8:\"question\";s:79:\"Has the entrepreneur acknowledged acceptance in shared control of the business?\";s:5:\"lower\";s:258:\"Lack of acknowledgement of shared control can create tension between the entrepreneurial team and investment parties which inhibit operations and growth of the company through inability to establish priorities among the opportunities and problems they face. \";s:6:\"higher\";s:161:\"Entrepreneurs who give up more equity and share control will attract further investment capital which will result in building greater value into the company \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:30:\"Not Addressed in Business Plan\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:19:\"No Ready Acceptance\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:17:\"Partial Reference\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:19:\"Somewhat Referenced\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:21:\"Accepts Control Shift\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}','2017-09-10 13:07:09',NULL,'true',25,1,NULL,10030,1006),(201,'Exit Target','raw','a:5:{s:8:\"question\";s:38:\"Has a specific target been identified?\";s:5:\"lower\";s:153:\"Difficulty in identifying a specific target suggests your business may not be attractive to potential buyers due to lack of strategic and growth planning\";s:6:\"higher\";s:166:\"A clear and defined exit strategy demonstrates the business has strategic goals that will promote long term growth and profitability to achieve the planned exit. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:4:\"None\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:21:\"Existing Shareholders\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:17:\"Private Placement\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:19:\"Targeted Trade Sale\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:23:\"Initial Public Offering\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}','2017-09-10 13:07:09',NULL,'true',16,1,NULL,10030,1006),(200,'Exit Strategy','raw','a:5:{s:8:\"question\";s:70:\" Is there a planned means of exiting the business that is appropriate?\";s:5:\"lower\";s:131:\"No defined exit strategy or your strategy is unrealistic suggests that that little long term strategic planning has been undertaken\";s:6:\"higher\";s:138:\"A well-defined achievable exit strategy is indicative of sound management, effective strategic planning and realistic financial projection\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"None Defined\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:25:\"Unrealistic Exit Strategy\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:19:\"Vague Exit Strategy\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:23:\"Unplanned Exit Strategy\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:26:\"Well Defined Exit Strategy\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}','2017-09-10 13:07:09',NULL,'true',16,1,NULL,10030,1006),(199,'Exit Time Period','raw','a:5:{s:8:\"question\";s:64:\"Is there an intention of selling the business in the near future\";s:5:\"lower\";s:130:\"No planned exit may infer the venture is only envisaged as a lifestyle business, or a family run business with a longer term view.\";s:6:\"higher\";s:236:\"An early sale in the short term suggests there are interested buyers in the market. This may have been your original intention to recoup your investment and exit the business early as there are other opportunities you now wish to pursue\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:5:\"Never\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:12:\"5 to 6 Years\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:12:\"3 to 5 Years\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:12:\"1 to 3 Years\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:16:\"Less than 1 Year\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}','2017-09-10 13:07:09',NULL,'true',16,1,NULL,10030,1006),(198,'Harvestability','raw','a:5:{s:8:\"question\";s:57:\"How easy do you believe it would be to sell the business?\";s:5:\"lower\";s:142:\"Unless harvest options are built into the business from day one, it will be very difficult to obtain a satisfactory return on your investment \";s:6:\"higher\";s:160:\"Three or more exit options provides the business with a strong negotiable position,  allowing room to manoeuvre, and potentially price negotiation on your terms\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:10:\"Impossible\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:13:\"1 Exit Option\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:14:\"2 Exit Options\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:14:\"3 Exit Options\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:24:\"More than 3 Exit Options\";s:5:\"score\";i:5;}}s:6:\"global\";i:3;}','2017-09-10 13:07:09',NULL,'true',16,1,NULL,10030,1006),(265,'Cost Structure (ratio of fixed to variable costs)','raw','a:5:{s:8:\"question\";s:35:\"How flexible is the cost structure?\";s:5:\"lower\";s:172:\"No or minimal flexibility in fixed or variable costs can increase the risk to long term viability by limiting ability of the business to adapt to changing market conditions\";s:6:\"higher\";s:220:\"A business with a flexible cost structure is better positioned to take advantages of market opportunities as they arise, or can make immediate adjustments as an important stream of revenue or profit becomes impaired.\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:20:\"Extremely Inflexible\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:11:\" Inflexible\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:18:\" Somewhat Flexible\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:8:\"Flexible\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:19:\" Extremely Flexible\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}','2017-09-10 13:07:09',NULL,'true',24,1,NULL,10030,1006),(264,'Time to Breakeven','raw','a:5:{s:8:\"question\";s:60:\"How long before the business will be operating at breakeven?\";s:5:\"lower\";s:185:\"To sell less than the breakeven point results in a loss. A longer period to achieve breakeven will defer profitability. Reduction in fixed costs may be able to reduce time to breakeven.\";s:6:\"higher\";s:280:\"Ability to breakeven early frees the business to target smaller, more attractive niches (rather than the broader market) and hence tailor products/services to provide more value to the customer resulting in greater brand equity, and positive effects on price, margin and/or share.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:7:\"5 Years\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"4 Years\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"3 Years\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:7:\"2 Years\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:17:\"Less than 2 Years\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}','2017-09-10 13:07:09',NULL,'true',24,1,NULL,10030,1006),(262,'Time to Profit (Annual)','raw','a:5:{s:8:\"question\";s:56:\"How long before the business will show an annual profit?\";s:5:\"lower\";s:193:\"Profit is a measurement of the overall performance of the company and those ventures that take 2 – 3 years to achieve an annual profit will struggle to achieve satisfactory levels of growth. \";s:6:\"higher\";s:143:\"Ventures able to show an annual profit within the first year demonstrate stronger potential for accelerated growth and long term sustainability\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:17:\"More than 3 Years\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:12:\"2 to 3 Years\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:15:\"12 to 24 Months\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:14:\"6 to 12 Months\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:18:\"More than 6 Months\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}','2017-09-10 13:07:09',NULL,'true',24,1,NULL,10030,1006),(258,'Gross Margin','raw','a:5:{s:8:\"question\";s:46:\"How large is the gross margin of the business?\";s:5:\"lower\";s:209:\"A robust gross margin is a key indicator of overall health of the business. A poor gross margin may leave the business in a vulnerable state to deal with fluctuations in the market or a sustained drop in sales\";s:6:\"higher\";s:237:\"A robust gross margin is a key indicator of the overall health of the business. The gross margin demonstrates that the average mark up on products/services adequately covers direct expenses and has the capacity to generate a profit. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"Less than 20%\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:10:\"20% to 35%\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:10:\"35% to 65%\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:10:\"65% to 80%\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:14:\" More than 80%\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}','2017-09-10 13:07:09',NULL,'true',24,1,NULL,10030,1006),(257,'Working Capital','raw','a:5:{s:8:\"question\";s:57:\"Does the business require high levels of working capital?\";s:5:\"lower\";s:281:\"There is a delicate balance in having just the right amount of working capital on hand. Implications to high levels of working capital include having insufficient funds to purchase revenue generating assets, such as equipment, plant, etc, and providing suboptimal business returns.\";s:6:\"higher\";s:257:\"There is an art to managing the delicate balance in amount of working capital required. A general maxim proposes minimising investment in working capital, but using caution to control this so that credit worthiness is not impaired in the eyes of creditors. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Extremely High\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:4:\"High\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Moderate\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:3:\"Low\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:13:\"Extremely Low\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}','2017-09-10 13:07:09',NULL,'true',24,1,NULL,10030,1006),(256,'Sales Growth','raw','a:5:{s:8:\"question\";s:58:\"What is the annual sales growth potential of the business?\";s:5:\"lower\";s:309:\"Lower sales growth may result from using own revenue to remain self-sustaining. If the business was to accelerate growth beyond this threshold it would need to seek outside funding. Slow growth rates may also result from a slowing economy or may be synonymous with a mature industry vs cutting edge technology\";s:6:\"higher\";s:388:\"Sales growth of greater than 20 to 30% demonstrates potential for fast growth. Accelerated growth can create difficulties if the business does not control the growth process (ability to keep pace with the expansion, fill orders, hire and train qualified employees, etc). Unanticipated boost in sales can leave growing ventures with a difficulty to obtain cash requirements from operations\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:12:\"Less than 5%\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:13:\"Less than 10%\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:12:\"At least 15%\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\" At least 20%\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:17:\" In excess of 30%\";s:5:\"score\";i:5;}}s:6:\"global\";i:1;}','2017-09-10 13:07:09',NULL,'true',24,1,NULL,10030,1006),(254,' Internal Rate of Return (IRR)','raw','a:5:{s:8:\"question\";s:27:\" What is the IRR potential?\";s:5:\"lower\";s:193:\"Internal rate of return (IRR) is a capital budgeting metric that measures profitability of investments. A low IRR (lower than the minimum hurdle rate) will signpost poor financial performance. \";s:6:\"higher\";s:275:\"Internal rate of return (IRR) is a capital budgeting metric measuring profitability of investments. Typically the higher the IRR (equal or greater than the hurdle rate) assumes healthier financial performance and a greater ability to make more significant capital gains. \r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:13:\"Less than 10%\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:10:\"Around 20%\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:10:\"Around 30%\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:10:\"Around 40%\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:16:\"In Excess of 50%\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}','2017-09-10 13:07:09',NULL,'true',24,1,NULL,10030,1006),(252,'After tax profits','raw','a:5:{s:8:\"question\";s:62:\"What level of after tax profits are achievable within 5 years?\";s:5:\"lower\";s:204:\"A low percentage of after tax profit on sales may signal to investors or lenders that business profitability is marginal and/or the entrepreneurial team lack effective financial management control systems\";s:6:\"higher\";s:232:\"Higher profit margins, expressed as a percentage of sales, provide investors and lenders with insight into business profitability and illustrate how effectively the entrepreneurial team manage to squeeze money out of total revenue. \";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:21:\"Less than 3% on Sales\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:20:\"At least 5% on Sales\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:22:\"At least 7.5% on Sales\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:21:\"At least 10% on Sales\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:20:\"15% or more on Sales\";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}','2017-09-10 13:07:09',NULL,'true',24,1,NULL,10030,1006),(253,'Net Cash Flow','raw','a:5:{s:8:\"question\";s:58:\"How long does it take to develop a positive net cash flow?\";s:5:\"lower\";s:241:\"Inability to generate an early positive cash flow may have serious implications for long-term success of the business. It is critical to monitor cash flow as it is key in depicting the venture’s financial health to investors and/or lenders\";s:6:\"higher\";s:277:\"Generating an early positive sustainable cash flow is critical for a firm\'s long-term success. Keeping track of cash flow is also important as how cash flow is captured and monitored plays a significant role in depicting the venture’s financial health to potential investors.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:17:\"More than 3 Years\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"3 Years\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:7:\"2 Years\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:9:\"1.5 Years\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:6:\"1 Year\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}','2017-09-10 13:07:09',NULL,'true',24,1,NULL,10030,1006),(251,'Capital Requirements','raw','a:5:{s:8:\"question\";s:91:\"Are high levels of capital required for the venture relative to the industry that it is in?\";s:5:\"lower\";s:371:\"Capital investment should benefit a company in the long run, but it can have a short-term downside. Intensive, ongoing capital investment reduces interim earnings, can strain liquidity, and potentially dilute earnings/ownership if new equity is used. Plan capital requirements as levels above industry average may adversely impact ongoing success and growth of a business\";s:6:\"higher\";s:484:\"Capital investment should benefit a company in the long run, but it can have a short-term downside. Intensive, ongoing capital investment reduces interim earnings, can strain liquidity, and potentially dilute earnings/ownership if new equity is used. Levels of capital below industry average may provide opportunity for competitive advantage, but if relatively low levels of capital are the industry standard this will create low barriers to entry and a market with strong competition\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:14:\"Extremely High\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:4:\"High\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:6:\"Medium\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:3:\"Low\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:8:\"Very Low\";s:5:\"score\";i:5;}}s:6:\"global\";i:4;}','2017-09-10 13:07:09',NULL,'true',24,1,NULL,10030,1006),(1079,'Insurance','raw','a:5:{s:8:\"question\";s:96:\"Does the business operate in a high risk industry for example agriculture, mining, construction?\";s:5:\"lower\";s:102:\"Businesses that operate in a lower risk industry can save significant costs in relation to insurance. \";s:6:\"higher\";s:172:\"If the business operates in a high risk industry that is cyclical, sensitive to environmental issues, etc, suggests that insurance costs may impact heavily on the business.\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:2:\"No\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:7:\"Minimal\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:8:\"Somewhat\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:13:\"Above Average\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:3:\"Yes\";s:5:\"score\";i:5;}}s:6:\"global\";i:2;}','2017-09-10 13:07:09',NULL,'true',23,1,NULL,10030,1006),(249,'Proprietary protection','raw','a:5:{s:8:\"question\";s:74:\"Does the firm have or can it gain protection of its proprietary knowledge?\";s:5:\"lower\";s:134:\"Little or no intellectual property (IP) leaves you vulnerable to infringement through imitation with no recourse to claim recompense. \";s:6:\"higher\";s:135:\"Strong intellectual property (IP) protection secures your place in the market and can increase the value and sale price of the business\";s:7:\"answers\";a:5:{i:0;a:2:{s:5:\"title\";s:7:\"No I.P.\";s:5:\"score\";i:1;}i:1;a:2:{s:5:\"title\";s:15:\"Developing I.P.\";s:5:\"score\";i:2;}i:2;a:2:{s:5:\"title\";s:9:\"Some I.P.\";s:5:\"score\";i:3;}i:3;a:2:{s:5:\"title\";s:15:\"Finalising I.P.\";s:5:\"score\";i:4;}i:4;a:2:{s:5:\"title\";s:23:\"Strong I.P. Protection \";s:5:\"score\";i:5;}}s:6:\"global\";i:5;}','2017-09-10 13:07:09',NULL,'true',23,1,NULL,10030,1006),(250,'Technology Ownership','raw','a:5:{s:8:\"question\";s:90:\"Does the business own the technology or does it license the technology from another party?\";s:5:\"lower\";s:118:\"Where high licensing fees are paid this could impact on the cash flow, profit margins, and sale price of the business.\";s:6:\"higher\";s:122:\"Owning IP provides added stability to the business and has the potential to open the door to multiple exit strategies.\r\n\r\n\";s:7:\"answers\";a:5:{i:0;a:2:{s: