eholders with low influence are low risk as they will not be able to hinder the project.\";s:6:\"medium\";s:191:\"External stakeholders with medium influence maybe hinder the success of the project if they are not aligned. Develop a communication and engagement plan to keep them aligned with the project.\";s:6:\"higher\";s:206:\"External stakeholders with high influence maybe able to hinder the success of the project if they are not aligned. Develop a detailed communication and engagement plan to keep them aligned with the project.\";s:7:\"answers\";a:3:{i:0;a:4:{s:5:\"alias\";s:3:\"low\";s:5:\"title\";s:3:\"Low\";s:5:\"score\";s:1:\"0\";s:4:\"desc\";s:0:\"\";}i:1;a:4:{s:5:\"alias\";s:6:\"medium\";s:5:\"title\";s:6:\"Medium\";s:5:\"score\";s:1:\"1\";s:4:\"desc\";s:0:\"\";}i:2;a:4:{s:5:\"alias\";s:4:\"high\";s:5:\"title\";s:4:\"High\";s:5:\"score\";s:1:\"2\";s:4:\"desc\";s:0:\"\";}}}','2017-08-17 01:33:43','2017-09-20 21:21:39','true',88,54,'to-what-extent-is-the-influence-of-internal-stakeholders-on-the-project',10018,1005),(10369,'Question 3','risk','a:7:{s:8:\"question\";s:67:\"To what extent can key internal stakeholders influence the project?\";s:6:\"global\";s:1:\"1\";s:4:\"desc\";s:0:\"\";s:5:\"lower\";s:172:\"Key internal stakeholders with high levels of influence are good for project success as they can help guide the project and clear hurdles. Keep them aligned to the project.\";s:6:\"medium\";s:205:\"Key internal stakeholders with medium levels of influence may not be helpful when challenging issues arise. Consider identifying stakeholders that can influence the project and align them with the project.\";s:6:\"higher\";s:229:\"Key internal stakeholders with low levels of influence are no help for project success as they can not help guide the project or clear hurdles. Identify stakeholders that can influence the project and align them with the project.\";s:7:\"answers\";a:3:{i:0;a:4:{s:5:\"alias\";s:4:\"high\";s:5:\"title\";s:4:\"High\";s:5:\"score\";s:1:\"0\";s:4:\"desc\";s:0:\"\";}i:1;a:4:{s:5:\"alias\";s:6:\"medium\";s:5:\"title\";s:6:\"Medium\";s:5:\"score\";s:1:\"1\";s:4:\"desc\";s:0:\"\";}i:2;a:4:{s:5:\"alias\";s:3:\"low\";s:5:\"title\";s:3:\"Low\";s:5:\"score\";s:1:\"2\";s:4:\"desc\";s:0:\"\";}}}','2017-08-17 01:34:22','2017-09-20 21:20:39','true',88,55,'to-what-extent-is-the-influence-of-external-stakeholders-on-the-project',10018,1005),(10370,'Question 2','risk','a:7:{s:8:\"question\";s:70:\"To what extent is the level of interest of your external stakeholders?\";s:6:\"global\";s:1:\"1\";s:4:\"desc\";s:0:\"\";s:5:\"lower\";s:131:\"External stakeholders with low interest will not require extensive communication or engagement as strong alignment is not required.\";s:6:\"medium\";s:161:\"External stakeholders with medium levels of interest will require good communication and engagement plans to prevent them from becoming resistant to the project.\";s:6:\"higher\";s:222:\"External stakeholders with high levels of interest will require detailed communication and engagement plans to keep them aligned. If they are not aligned they could appose the project increasing the probability of failure.\";s:7:\"answers\";a:3:{i:0;a:4:{s:5:\"alias\";s:3:\"low\";s:5:\"title\";s:3:\"Low\";s:5:\"score\";s:1:\"0\";s:4:\"desc\";s:0:\"\";}i:1;a:4:{s:5:\"alias\";s:6:\"medium\";s:5:\"title\";s:6:\"Medium\";s:5:\"score\";s:1:\"1\";s:4:\"desc\";s:0:\"\";}i:2;a:4:{s:5:\"alias\";s:4:\"high\";s:5:\"title\";s:4:\"High\";s:5:\"score\";s:1:\"2\";s:4:\"desc\";s:0:\"\";}}}','2017-08-17 01:35:00','2017-09-20 21:18:16','true',88,56,'to-what-extent-do-internal-stakeholders-pose-challenges-to-project-delivery',10018,1005),(10371,'Question 1','risk','a:7:{s:8:\"question\";s:70:\"To what extent is the level of interest of your internal stakeholders?\";s:6:\"global\";s:1:\"1\";s:4:\"desc\";s:0:\"\";s:5:\"lower\";s:108:\"A high level of interest increases the likelihood of support and approval of funds, support, and resources. \";s:6:\"medium\";s:238:\"Stakeholders that are somewhat interested may or may not support the project increasing the difficulty of approval of funds and resources.  Develop a stakeholder engagement plan to promote the benefits of the project and increase support.\";s:6:\"higher\";s:196:\"A low level of interest decreases the likelihood of support and approval of funds and resources.  Develop a stakeholder engagement plan to promote the benefits of the project and increase support.\";s:7:\"answers\";a:3:{i:0;a:4:{s:5:\"alias\";s:4:\"high\";s:5:\"title\";s:4:\"High\";s:5:\"score\";s:1:\"0\";s:4:\"desc\";s:0:\"\";}i:1;a:4:{s:5:\"alias\";s:8:\"somewhat\";s:5:\"title\";s:9:\"Somewhat \";s:5:\"score\";s:1:\"1\";s:4:\"desc\";s:0:\"\";}i:2;a:4:{s:5:\"alias\";s:3:\"low\";s:5:\"title\";s:3:\"Low\";s:5:\"score\";s:1:\"2\";s:4:\"desc\";s:0:\"\";}}}','2017-08-17 01:35:48','2017-09-20 21:17:26','true',88,57,'to-what-extent-do-external-stakeholders-pose-challenges-to-project-delivery',10018,1005),(10372,'Question 7','risk','a:7:{s:8:\"question\";s:63:\"Are the contract management (CM) processes effectively applied?\";s:4:\"desc\";s:0:\"\";s:6:\"global\";s:0:\"\";s:5:\"lower\";s:149:\"The application of CM processes and standards ensure that your contractors fulfil their roles and responsibilities throughout the project life cycle.\";s:6:\"medium\";s:86:\"CM processes need to be applied in a consistent manner to prevent management failures.\";s:6:\"higher\";s:86:\"CM processes need to be applied in a consistent manner to prevent management failures.\";s:7:\"answers\";a:3:{i:0;a:4:{s:5:\"alias\";s:33:\"cm-processes-consistently-applied\";s:5:\"title\";s:33:\"CM processes consistently applied\";s:5:\"score\";s:1:\"0\";s:4:\"desc\";s:0:\"\";}i:1;a:4:{s:5:\"alias\";s:28:\"partial-cm-processes-applied\";s:5:\"title\";s:28:\"Partial CM processes applied\";s:5:\"score\";s:1:\"1\";s:4:\"desc\";s:0:\"\";}i:2;a:4:{s:5:\"alias\";s:40:\"little-or-no-application-of-cm-processes\";s:5:\"title\";s:40:\"Little or no application of CM processes\";s:5:\"score\";s:1:\"2\";s:4:\"desc\";s:0:\"\";}}}','2017-09-20 18:45:39','2017-09-20 20:54:58','true',82,58,NULL,10031,1005),(10373,'Question 9','risk','a:7:{s:8:\"question\";s:105:\"How would you describe the availability of specialised materials/resources critical to your deliverables?\";s:4:\"desc\";s:0:\"\";s:6:\"global\";s:0:\"\";s:5:\"lower\";s:128:\"Ensure that the specialised materials are procured ahead of schedule to reduce risks of long-lead times and not being available.\";s:6:\"medium\";s:171:\"Investigate availability of specialised materials and ensure procurement plans and contingencies are in place. Lack of availability may cause budget and schedule overruns.\";s:6:\"higher\";s:263:\"Specialised materials and resources require you to do thorough investigation into cost and procurement of resources and that there is sufficient funding to obtain them. There is likely to be  an impact on costing and scheduling by requiring specialised materials.\";s:7:\"answers\";a:3:{i:0;a:4:{s:5:\"alias\";s:19:\"generally-available\";s:5:\"title\";s:19:\"Generally available\";s:5:\"score\";s:1:\"0\";s:4:\"desc\";s:0:\"\";}i:1;a:4:{s:5:\"alias\";s:29:\"unsure-regarding-availability\";s:5:\"title\";s:29:\"Unsure regarding availability\";s:5:\"score\";s:1:\"1\";s:4:\"desc\";s:0:\"\";}i:2;a:4:{s:5:\"alias\";s:31:\"limited-availability-long-leads\";s:5:\"title\";s:32:\"Limited availability/ long-leads\";s:5:\"score\";s:1:\"2\";s:4:\"desc\";s:0:\"\";}}}','2017-09-20 18:48:17','2017-09-20 20:52:20','true',82,60,NULL,10031,1005);
