INSERT INTO `tbl_data` VALUES (45,'App Information','app-information','a:1:{s:7:\"content\";s:2111:\"<div class=\"raw-info\"><img class=\"logo\" src=\"http://rawninety.com.au/sites/all/themes/bootstrap/bootstrap_subtheme/raw90_logo.png\" /> VERSION 1.0</div>\n\n<p>So you have purchased the Raw90&deg;app! Well done. You now have in the palm of your hand the go-to opportunity assessment app used by entrepreneurs, innovators, SME&rsquo;s and start-ups all over the world.</p>\n\n<p>Raw90&deg; will allow you as an individual or as a team to assess the strengths and weaknesses of your next venture. Based on over 40 years of quantitative research, from some of the world&rsquo;s leading experts in the fields of entrepreneurship, commercialisation and innovation, Raw90&deg; will ask the hard questions every successful venture needs to be able to answer.</p>\n\n<p>Raw90&deg; is currently being utilised by The University of Adelaide&rsquo;s Entrepreneurship MOOC (Massive Online Open Course), hosted on the Harvard and MIT edX Platform</p>\n\n<p>The Raw90&deg; advantage:</p>\n\n<p>● Over 100 questions from key categories including Opportunity, Team, Resources and Environment</p>\n\n<p>● Responses plotted against a target base score on easy to read radar graphs</p>\n\n<p>● Graphs clearly define the strengths and weaknesses of the venture against the base correct practice methodology</p>\n\n<p>● Insightful and directional feedback given to all responses</p>\n\n<p>● Easy to share your project, graphs and outcome information with team members</p>\n\n<p>● Up to 5 team member&rsquo;s input data can be overlaid in radar graphs for comparison of strengths and weaknesses of venture</p>\n\n<p>Raw90&deg; is part of a suite of apps developed under the 90&deg;Ready brand, which have been created to help entrepreneur&rsquo;s, startup&rsquo;s and SME&rsquo;s, to have a clearer understanding of a venture&rsquo;s strengths and weaknesses. Our aim is to ensure your next project is 90&deg;Ready, that&rsquo;s a 90&deg; trajectory heading in the right direction for financial success.</p>\n\n<p>Have a question, problem, or feedback? Reach out to us at <a href=\"mailto:feedback@ninetyready.com\">feedback@ninetyready.com</a></p>\n\";}','2017-07-28 09:00:56','2017-07-28 09:00:56','raw_content','true',-1,-1,'','',41,'10018'),(46,'Terminology Database','terminology-database','a:1:{s:7:\"content\";s:44493:\"<div>\n<div>\n<h2>1 OPPORTUNITY</h2>\n\n<div>\n<h3>1.1 TARGET MARKET</h3>\n\n<div>\n<h4>1.1.1 Target Market Size</h4>\n\n<p><strong>Current Market Size</strong> Current market size is a measure of the total volume of a given market. It can either be expressed as amount of individual customers, of units sold, or revenues resulting from the amount of the particular goods sold.</p>\n\n<p><strong>Market Size Potential</strong> Market size potential is the forecast maximum size of the market. Like current market size, it can be expressed as individual customers, potential units sold, or revenues.</p>\n\n<p><strong>Market Growth Rate</strong> Market growth rates refers to the increase in size of the market over a designated time period (normally quarterly, half yearly or annually). This figure refers to the market as a whole, including all competitor products.</p>\n\n<p><strong>Local Market Share Attained</strong> Location market share attained refers to the amount (often expressed as a percentage) of the total market the business has captured in a specific geographic location.</p>\n\n<p><strong>International Market Share Attained</strong> International market share attained refers to the amount (often expressed as a percentage) of the total market the business has captured internationally.</p>\n\n<p><strong>Domestic Market Share Attainable</strong> Domestic market share attainable refers to the amount (often expressed as a percentage) of the total market the business has yet to capture within a specified geographic location, and which based on strategic analysis it believes is possible to attain.</p>\n\n<p><strong>International Market Share Attainable</strong> International market share attainable refers to the amount (often expressed as a percentage) of the total market the business has yet to capture internationally, and which based on strategic analysis is believes is possible to attain.</p>\n</div>\n\n<div>\n<h4>1.1.2 Market Structure</h4>\n\n<p><strong>Market Structure: Niches</strong> Market niche is a specific customer grouping or segment that has particular and unique characteristics compared to the larger market. The entrepreneur designs the product to meet the preferences of the specific niche (in respect to pricing, features, availability and distribution and so on).</p>\n\n<p><strong>Industry Life Cycle</strong> Industry life cycle refers the stages the product category will go through, from inception with first products growing through to maturity with a larger range of competitors offering more sophisticated products, eventually dying as the product category gets replaced by a newer product category often constructed from a new technology. A good example is Kodak and film cameras, being replaced by digital cameras.</p>\n\n<p><strong>Dependence on other products</strong> Dependence on other products is a measure of interdependency. Does the product require support products in order to provide complete value to a customer. For example, the value of a motorcar is dependent on support products such as roads and more specifically extensive refueling networks.</p>\n\n<p><strong>Window of Opportunity</strong> A window of opportunity refers to a momentary opportunity where the capacity for performance and innovation greatly increases in comparison to other times. A window of opportunity may be created by a current unfulfilled customer need, a temporary capacity of a technology, or the state of competition. Implicit in the idea of a window is that these conditions are limited and will recede or disappear based on changing factors.</p>\n\n<p><strong>Window Duration</strong>Window duration is a forecast of the amount of time the entrepreneur has to capitalize on favorable conditions, before the window of opportunity will close.</p>\n\n<p><strong>Market Capacity: Products</strong>Market capacity refers to the amount of similar products that can be sustained by the market.</p>\n</div>\n\n<div>\n<h5>1.1.2.1 Competitors</h5>\n\n<p><strong>Number of Competitors </strong> How many direct competitors are there currently in the market, offering similar producst to the business in focus.</p>\n\n<p><strong>Competitor Strength</strong> Competitor strength assesses the capacity of competition in respect to their capacities to create, market and distribute the particular relevant product to the market.</p>\n\n<p><strong>Competitor Reputation</strong> Competitor reputation describes any advantage or disadvantage of competitors related to their reputation. This may accrue from previous customer history, alternative products. It results in brand recognition and loyalty (or the opposite).</p>\n</div>\n\n<div>\n<h5>1.1.2.2 Customers</h5>\n\n<p><strong>Customer Need</strong> Customer need refers to the problem that the product solves for the customer, or the benefit it delivers to the customer.</p>\n\n<p><strong>Customer Existence</strong> Customer existence refers to the familiarity and use of the product by a target customer- can an identifiable pre existing customer base be identified, or is this a new product that is creating a new customer behavior.</p>\n\n<p><strong>Number of Key Customers</strong> Number of key customers refers to the identification of critical customers that have a disproportionately large effect on overall performance of the business. These customers can have an important position in the market due to the nature of the target market, or due to their credibility as a referral source for other customers.</p>\n\n<p><strong>Market Capacity: Customers</strong> Market capacity refers to the amount of similar products that can be sustained by the market.</p>\n\n<p><strong>Customer Dependence</strong> Customer dependence refers to the risks associated with the business having to rely on too few or too powerful customers.</p>\n\n<p><strong>Bargaining Power of Customers</strong> Bargaining power of customers refers to the pressures consumers can exert on a business, largely driven by choice, related to quality, features or price.</p>\n\n<p><strong>Rent Roll</strong> A rent roll situation results when, after the initial sale is made, there is a compelling reason for customers to come back and buy the product or related product(s) again and again. For example, once a photocopier is sold, there is a need to purchase ink cartridges on an ongoing basis for that photocopier.</p>\n\n<p><strong>Rent Roll Capability</strong> Rent roll capability refers to the likelihood or otherwise of the business to establish a product that offers secondary income streams related to rent rolls.</p>\n\n<p><strong>Customer Contracts</strong> Customer contracts refers to the contract related to a negotiated ongoing payment relationship with the customer. Common examples are a mobile phone contract, or a financed car purchase contract.</p>\n\n<p><strong>Customer Contracts</strong> Customer contracts refers to the contract related to a negotiated ongoing payment relationship with the customer. Common examples are a mobile phone contract, or a financed car purchase contract.</p>\n\n<p><strong>Target Market Focus</strong> Target market focus refers to the tailoring of the design of the product (in respect to features such as performance, price, distribution etc.) to match the preferences of a specific target market. Consumer adoption is a choice of perceived value, and if the product has not been designed for a specific target market, it is unlikely to be adopted based on the failure to appreciate specific preferences.</p>\n\n<p><strong>Customer Payback</strong> Customer payback refers to the time it take to recoup investment to acquire the customer. Costs such as marketing must be spent up front before revenues. Customer payment is a measure of the time until expenses are recouped.</p>\n\n<p><strong>Basis for Growth Strategy Existence</strong> How realistic are the forecasts related to growth, and what is the relationship between the accuracy of the forecasts and the viability of the business.</p>\n\n<p><strong>Basis for Growth Strategy Suitability</strong> Is the growth strategy suitable for the business dependent upon the market, the type of product (technology), team and stage of available resources.</p>\n</div>\n\n<div>\n<h4>1.1.3 Pricing</h4>\n\n<p><strong>Price</strong> The purchase price of the good. The willingness for customers to pay a certain price is relative to the value the product delivers to a particular user.</p>\n\n<p><strong>Price Sensitivities</strong> Price sensitivities refers to the price range the customer is willing to pay. If the range is short, then it is said the customer is price sensitive. If the customer is tested and prepared to buy the product over a wide range of prices then the customer is said to be insensitive to price (offering higher margins- think of Rolls Royce pricing).</p>\n\n<p><strong>Marketing and Distribution Costs</strong> Marketing and distribution costs refer to the costs related to marketing (informing potential customers of your product) and distribution (the way in which the customer receives your product).</p>\n\n<p><strong>Degree of Control over Price Setting - Price Maker</strong> Degree of control over price setting refers to the state of price competition, as well as if the business is viewed as an authority by the target demographic.</p>\n\n<p><strong>Degree of Control over Costs</strong> Degree of control over costs refers to the power or authority that the business has in respect to key suppliers.</p>\n\n<p><strong>Degree of Control over Distribution Channels</strong> Degree of control over distribution channels refers to the authority the business has over key distribution channels. For example, a food business reliant on Woolworths or Coles has little control. Whereas Ikea designs its own products as well as controls the stores where they are sold.</p>\n\n<p><strong>Price elasticity</strong> Price elasticity is a measure of the effect of a price change on the demand for a product.</p>\n\n<p><strong>Pricing policy</strong> Pricing policy refers to the strength and detail in the underling pricing strategy for the business.</p>\n\n<p><strong>Price maker</strong> Price maker refers to a position where a company has entered a new market, or is seen as an authority in an existing market, and has the capacity to set prices themselves, with less regard for the relative price to competitors.</p>\n</div>\n</div>\n\n<div>\n<h3>1.2 PRODUCT</h3>\n\n<div>\n<h4>1.2.1 Product Characteristics</h4>\n\n<p><strong>Product Diversification</strong> Has the business the capacity to offer a diversified product range, rather than just a single product. This can aid consumer repeat purchases, as well as offering more feedback regarding consumer preferences in the early stage.</p>\n\n<p><strong>Substitute Products</strong> Substitute products are two or more products that could be used for the same purpose.</p>\n\n<p><strong>Complimentary Products</strong> A complimentary good is a good whose perceived value can change as a result of the presence of a related product. The sale of combustion engine cars for example, has a complimentary relationship with petrol stations.</p>\n\n<p><strong>Product Addiction</strong> Product addiction refers to the repetitive nature of the value your product provides the customer. How often is a customer actively using your product.</p>\n\n<p><strong>Product Safety</strong> Product safety describes the potential hazards with the use of the product, as well as the potential customer learning curve related to use.</p>\n\n<p><strong>Novelty</strong> A novel product is one that has few precedents, and establishes a new market or a new consumer behavior.</p>\n\n<p><strong>No of dependent suppliers</strong> Dependent suppliers describes the relationship the business has to supplier markets. The more dependent suppliers the business has available to them, the greater the businesses bargaining position.</p>\n\n<p><strong>Product waste</strong> Product waste describes the waste related to product manufacture, or waste created by the product in use. For example, packaging of the product often is discarded waste- and must meet safety and waste standards.</p>\n\n<p><strong>Ease of disposal</strong> Ease of disposal relates to obsolescence- are there any hazards related to disposal of the product, or does the business provide consumers any processes for disposal?</p>\n</div>\n\n<div>\n<h4>1.2.2 Process</h4>\n\n<p><strong>Complexity of Production Process</strong> Complexity of production process describes the difficulty of production. The complexity is represented in things such as the capital intensity of production equipment, production lead times, amount and stability of component producers, the role of automation and so forth.</p>\n\n<p><strong>Quantity of inputs needed</strong> How many inputs or components are needed to create the product. Does it require coordination of many independent suppliers. Does the business have control or leverage over these relationships.</p>\n\n<p><strong>Service or Product Business</strong> Does the business sell customers a service, or a product. Service businesses sell a less tangible product, making production costs harder to estimate (or at least variable costs) as well as pricing more dynamic. Product businesses generally are margin businesses, where profit margins and volume are important.</p>\n\n<p><strong>Storage requirements</strong> Storage requirements relate to inventory, both of finished goods, or components. Perishability, security, depreciation are issues, as well as capital lock up as a result of holding inventory are all considerations here.</p>\n</div>\n</div>\n\n<div>\n<h3>1.3 SUSTAINABLE COMPETITIVE ADVANTAGE (SCA)</h3>\n\n<div>\n<h4>1.3.1 Production Issues</h4>\n\n<p><strong>Low Cost Producer</strong> Can the company produce their goods or services at a low cost. This will result in pricing flexibility- higher retail prices will give higher margins, or the company can compete on cost with a lower retail price and larger volumes.</p>\n\n<p><strong>Cost Advantage</strong> Can the business achieve a production or distribution cost advantage relative to other competitors in the market, that allow them to achieve better profit margins or lower retail cost.</p>\n\n<p><strong>Scalability</strong> Does the business have the capacity to scale production or management in the event of increased demand. What level of redundancy does the business currently have in respect to their capacity.</p>\n\n<p><strong>Scalability Competitive Advantage</strong> What effect does operating at larger scale have on the business. A scalability competitive advantage would relate to situations where increased volume would have a positive effect on performance- such as offering economies of scale leading to higher production margins. Competitive advantage can emerge at scale from other parts of the business too, such as relationship with key suppliers, distribution channels etc.</p>\n\n<p><strong>Finished Goods Inventory levels (1)</strong> Finished good inventory refers to goods that have been produced, and awaiting deployment to distribution channels, or potentially have already been sold to customers.</p>\n\n<p><strong>Finished Goods Inventory levels (2)</strong> Finished good inventory refers to goods that have been produced, and awaiting deployment to distribution channels, or potentially have already been sold to customers.</p>\n\n<p><strong>Inventory Levels</strong> The current level of inventory of finished goods of the business. This can also refer to component inventory levels as an important measure of current production ability.</p>\n\n<p><strong>Raw material cost</strong> Raw material cost refers to the cost of the basic materials from which the product is made. What the components of the product, and what are their current cost. This can fluctuate over time based on wider market conditions, as well as competition. Basic materials cost has an effect on production margins.</p>\n\n<p><strong>Technology Innovation</strong> Technology innovation refers to the implementation of new technologies that provide customers or the business a new form of value (increased efficiency, better customer experience in terms of lower cost or higher quality distribution choices etc.)</p>\n\n<p><strong>Production Innovation</strong> Production innovation refers to new production methods that provides increased value (better quality manufactured goods, or related to the delivery of the same goods at increased efficiency- lower prices, less materials etc.).</p>\n\n<p><strong>Cost of flexibility</strong> What trade offs has the business made in respect to cost structure. Does the business have low flexibility by controlling assets, with higher fixed costs and lower marginal costs, or does the business have high flexibility renting assets and paying a premium marginal cost for the flexibility.</p>\n</div>\n\n<div>\n<h4>1.3.2 Product Differentiation</h4>\n\n<p><strong>Satisfied Customers</strong> Does the business have a past track record with customers, and if so can the business gain customer endorsement. In the earliest stages of the business, this should be a focus, even at the prototype stage, prior to launch. Engagement with customers is the single biggest proof a business can give of customer response to the product. It is the job of entrepreneurs to get direct feedback as early and often as possible.</p>\n\n<p><strong>Complimentary Products</strong> Complimentary products refer to associated products whose presence can have a direct effect on the perceived value of the product of the business.</p>\n\n<p><strong>No of intermediaries </strong> No of intermediaries refers to the length of distribution channel, and the number of intermediaries between the business and the customer. Each intermediary often will bring with it an increase in cost of the product.</p>\n\n<p><strong>Competing Products</strong></p>\n</div>\n\n<div>\n<h4>1.3.3 Strategic Partnerships</h4>\n\n<p><strong>Endorsements</strong> Is there any businesses that are willing to endorse the business. Often employed as a legitimation strategy for young businesses, if the business can achieve endorsement from key customers with prominent reputations, or via key suppliers, this can improve the likelihood of adoption of the product.</p>\n\n<p><strong>Number of Supply Channels</strong> Does the business have a range of suppliers, or is the business dependent (and vulnerable) on a particular supplier. Conversely, having a single supplier might have an advantage, if a cost advantage can be achieved.</p>\n\n<p><strong>Established Strategic Alliances</strong> What relationships does the business have (or plan to have) with associations or alliances that can aid the businesses legitimacy or offer switching costs.</p>\n\n<p><strong>No of Distribution Channels</strong> How does the business sell to the customer? Are there a range of distribution channels utilized or does the business have a singular distribution focus? Decisions must be justified.</p>\n</div>\n\n<div>\n<h4>1.3.4 Barriers to Entry/Exit</h4>\n\n<p><strong>Location</strong> Location offers particular advantages and disadvantages for the business. These may relate to cost of labor, proximity to the target market, time issues with overseas suppliers and so forth. Equally, for direct to customer retail operations, location is a critical decision.</p>\n\n<p><strong>Lead time advantage</strong> Can the business establish an advantage over competition in respect to manufacturing and distribution time for orders.</p>\n\n<p><strong>Brand Loyalty</strong> Has the business (or can the business) establish brand loyalty. Ideally through word of mouth and repeat purchases, but also aided by marketing. It is possible for early market entrants to build brand loyalty cheaply. For late market entrants, often it requires inflated marketing efforts.</p>\n\n<p><strong>Legal/Contractual Advantages</strong> Can the business establish advantages related to contracts with key suppliers or distribution channels. For example, can the business create an exclusive license with a key component supplier.</p>\n\n<p><strong>High Capital Costs</strong> Is the product and business capital intensive, both in respect to establishment costs as well as ongoing activity (compare for example, the capital cost of establishing a mining business compared to a coffee shop).</p>\n\n<p><strong>Specialist Skills</strong> Does the entrepreneur or entrepreneurial team have identified unique specialist skills that could be the source of advantage, with that advantage not being accessible by competitors. This may be an expert in research or emerging science.</p>\n\n<p><strong>Transportation Costs</strong> Transport costs refer to the costs associated with getting the product from manufacturing location to distribution location.</p>\n\n<p><strong>Market Structure (1)</strong> Market structure refers to the state of competition in the market, whether there exist clear established leaders, or whether there is opportunity for first mover advantages.</p>\n\n<p><strong>Market Structure (2)</strong> Market structure refers to the state of competition in the market, whether there exist clear established leaders, or whether there is opportunity for first mover advantages.</p>\n</div>\n\n<div>\n<h4>1.3.5 Research &amp; Development</h4>\n\n<p><strong>R&amp;D Dependency</strong> R&amp;D Dependency describes the relationship between the final product and research and development- does the product require R&amp;D, what lead times are expected for commercialization of R&amp;D, how dependent is commercialization on the current state of R&amp;D.</p>\n\n<p><strong>R&amp;D Program</strong> Does the business have/require a Research and Development program. What plans does the business have for this, including necessary expertise, funding and deadlines.</p>\n\n<p><strong>R&amp;D Funding Levels required</strong> Does the business have a clear plan and understanding of both the work to be done to complete R&amp;D, as well as the financial commitment to fund the research until commercialization.</p>\n\n<p><strong>R&amp;D Funding sufficiency</strong> Does the business have sufficient funding for R&amp;D execution plan.</p>\n</div>\n\n<div>\n<h4>1.3.6 Legal/Contractual</h4>\n\n<p><strong>Technology Ownership</strong> Who owns the proprietary created by the business- that is, does the business have adequate contracts in place with key employees or external stakeholders that sufficiently identifies ownership structure of proprietary technology.</p>\n\n<p><strong>Proprietary Protection</strong> What controls and protections (e.g. patents) does the business have for any proprietary technology they may have created.</p>\n\n<p><strong>Technology Ownership</strong> Who owns the proprietary created by the business- that is, does the business have adequate contracts in place with key employees or external stakeholders that sufficiently identifies ownership structure of proprietary technology.</p>\n</div>\n</div>\n\n<div>\n<h3>1.4 FINANCIAL PERFORMANCE</h3>\n\n<p><strong>Capital Requirements</strong> Capital requirements is the amount of capital a bank or other financial institution has to hold to cover its liabilities.</p>\n\n<p><strong>After Tax Profits</strong> After tax profits is a comparison of net income after taxation to net sales. It provides the business an understanding of their profits per unit after all expenses including tax has been accounted for.</p>\n\n<p><strong>Net Cash Flow</strong> Net cash flow refers to the difference between cash inflow from sales compared to the cash outflow from expenses in a given period. The greater the positive figure, the less risk of the business.</p>\n\n<p><strong>Internal Rate of Return (IRR)</strong> Internal rate of return is a calculation that is used to assess the profitability of the business investment. It is the interest rate at which the net present value of all cash flows from a project equal zero.</p>\n\n<p><strong>Investment Multiple Returned</strong> Investment multiple returned is a measure of the returns paid to an investor. It is a measure of the cumulative dollar amount returned to the investor compared to their investment. It can be used as an outcome or as a projection.</p>\n\n<p><strong>Sales Growth</strong> Sales growth is the amount the sales volume, either in units sold or in revenues, has grown compared to a previous period. Generally sales growth is calculated on a quarterly, half yearly or annual basis.</p>\n\n<p><strong>Working Capital</strong> Working capital is a calculation of current assets minus current liabilities. It represents the capital available to the business to use in operation. It is an important measure of the current capacity of the business to meet responsibilities and remain solvent.</p>\n\n<p><strong>Free Cash Flow (FCF)</strong> Free Cash Flow is the amount of cash the business generates after accounting for all expenditure responsibilities such as rent, wages, and lease arrangements. Free cash can be used to pay dividends to investors, invest in marketing or growth, or can be used to reduce any debt of the business above normal repayments.</p>\n\n<p><strong>Gross Margin</strong> Gross margin is the difference the selling price and the cost of production for the product.</p>\n\n<p><strong>Historical Performance</strong> Historical performance is the past performance of the business in respect to a particularly financial criteria. How does the current performance compared to previous performance. This data is not available to businesses pre launch.</p>\n\n<p><strong>Time to Cash Neutral</strong> Time to cash neutral refers to the amount of time until the business is generating enough income to cover expenses. Most businesses are not cash flow positive initially, but require investment to cover expenses during the cash burn phase until such time as revenues develop.</p>\n\n<p><strong>Time to Profit (Annual)</strong> Time to profit is a time based projection of profit in a particular year. If forward projections suggest profitability is achieved in a particular future month, the time to profit figure is a measure of proximity to profitability on a month by month basis.</p>\n\n<p><strong>Time to Profit (Cumulative)</strong> Time to profit cumulative is a forward projection of when the business will generate a profit, forecast cumulatively.</p>\n\n<p><strong>Time to Breakeven</strong> Time to breakeven represent the amount of time it takes for an investment to make back its original cost.</p>\n\n<p><strong>Cost Structure (Ratio of Fixed to Variable Costs)</strong> Cost structure refers to the amount and relationship of fixed and variable costs the business incurs. Variable cost is a cost that varies with the level of output. A fixed cost is a cost that does not change as a result of level of output.</p>\n\n<p><strong>Gearing</strong> Gearing refers to the ratio of a company&#39;s capital (debt), to the value of its revenues and ordinary shares.</p>\n</div>\n\n<div>\n<h3>1.5 HARVESTABILITY</h3>\n\n<p><strong>Valuation Multiples</strong> Valuation multiple is a measure of market value of the equity relative to the expected future earnings of the business.</p>\n\n<p><strong>Harvest Ability</strong> Harvest ability refers to the potential of the business unit to be sold to an external company.</p>\n\n<p><strong>Exit time period</strong> Exit time period is a transition period after agreement for an exit has been made until the exit is completed.</p>\n\n<p><strong>Exit Strategy</strong> Exit strategy is a specific strategy and forecast of a pre planned exit to the business for the entrepreneurial and investment team.</p>\n\n<p><strong>Exit target</strong> Exit target is a targeted strategy for exit. The most common exit target is a larger competitor or business with a complementary business unit. Google for example buying YouTube is an example. The trade sale is completed by negotiation.</p>\n</div>\n</div>\n\n<div>\n<h2>2 TEAM</h2>\n\n<div>\n<h3>2.1 INVESTOR READINESS</h3>\n\n<p><strong>Control</strong> Control refers to the required proportion of equity to establish control of the business. Ultimately to remain in total control of a business, an equity stake of 51% or above is required. However, if equity is diluted between many shareholders, it may be possible to control the business with a smaller stake, as long as it remains the majority.</p>\n\n<p><strong>Equity</strong> Equity refers to the issued ownership shares of the business. Total equity refers to the total amount of shares issued to shareholders. Equity stake refers to an individuals unique share of the total.</p>\n\n<p><strong>Board</strong> A board of directors is a governing body of the business. Members of the board (recognized as directors) are elected by shareholders. The board has decision making authority for the business.</p>\n\n<p><strong>Independent Chairman</strong> An Independent Chairman is an external individual who is chosen to preside over meetings, as well as key appointments and strategic decisions of the business. They often will not have much role in the day to day operations of the business.</p>\n\n<p><strong>Audit</strong> An audit is an official inspection of the accounts of the business.</p>\n\n<p><strong>Hurt Capital</strong> Hurt money refers to the personal investment position of the founders. Does the entrepreneur stand to gain or lose from the performance of the business. If there is not enough personal entrepreneur investment it may be a sign of belief or commitment to the business.</p>\n</div>\n\n<div>\n<h3>2.2 ENTREPRENEURIAL SKILLS</h3>\n\n<p><strong>Startup and/or Harvest Experience</strong> Startup and harvest experience refers to the previous experience of the entrepreneur or entrepreneurial team. If the entrepreneur or team can demonstrate previous experience (success is best, but failure can also be seen as a positive), they are more likely to gain investment.</p>\n\n<p><strong>Entrepreneurial History</strong> Entrepreneurial experience refers to the previous experience of the founders. Experience helps establish credibility.</p>\n\n<p><strong>Marketing Instinct and Ability</strong> Marketing instinct and ability refers to the ability of the entrepreneur to demonstrate ability to sell. Do they understand the target market and the preferences of the target market when these aren&#39;t particularly obvious at first glance.</p>\n</div>\n\n<div>\n<h3>2.3 FUNCTIONAL SKILLS</h3>\n\n<p><strong>Knowledge of business</strong> Knowledge of the business refers to the depth of understanding the entrepreneur or entrepreneurial team can demonstrate in respect to the proposed business model. This relates to previous experience in the product category or in related categories.</p>\n\n<p><strong>Knowledge of market</strong> Knowledge of the market refers to the depth of understanding the entrepreneur or entrepreneurial team can demonstrate in respect to the characteristics and preferences of the target market. This is one of the most important determinants of success. Can the business, build something the target market wants. And this is driven by understanding and familiarity with the target market.</p>\n\n<p><strong>Industry and Technical Experience</strong> Does the entrepreneurial team have the technical capacity and experience to build a product.</p>\n\n<p><strong>Sales/Marketing Experience</strong> Does the entrepreneurial team have sales and marketing experience relevant to the product? Can they demonstrate understanding of key marketing terms such as inbound and outbound marketing, direct selling, affiliate marketing etc. Do they also understand how to select the most effective marketing method in alignment with the target market.</p>\n\n<p><strong>Distribution Experience</strong> What relevant distribution channel experience does the entrepreneur or entrepreneurial team have. Distribution channel refers to the technology or business intermediaries through which a good is sold onto the end consumer. Does the lead entrepreneur have experience key distribution channels of the business.</p>\n\n<p><strong>Financial Experience</strong> Does the entrepreneurial team have experience in financial management and financial documentation.</p>\n\n<p><strong>Technical Experience</strong> Does the entrepreneurial team have the technical capacity and experience to build a product.</p>\n\n<p><strong>Technical Qualifications</strong> Technical qualifications relevant to any aspect of the business, but primarily with building product.</p>\n\n<p><strong>Functional Knowledge and Skills Balance</strong> Functional knowledge and skills balance refers to the overall depth of knowledge the team has across all business elements, and how well balanced the skill stack of the team is across all elements of the business. Having two technical experts but no marketing expertise would be seen as a weakness compared to a more balanced team.</p>\n\n<p><strong>Bottom Line Responsibility</strong> Is it clear who is ultimately responsible for the performance of the business, and who takes responsibility in light of particular performance outcomes, primarily financial.</p>\n</div>\n\n<div>\n<h3>2.4 LEADERSHIP SKILLS</h3>\n\n<p><strong>Lead Entrepreneur</strong> Lead entrepreneur refers to the single individual who is driving the decisions of the business. Whilst there may be a founding team, It is difficult to lead by committee, and instead great teams have talented individuals in roles that enable them to perform. The lead entrepreneur is viewed as the coordinating function.</p>\n\n<p><strong>Entrepreneurial Team</strong> Entrepreneurial team refers to the team of individuals in place to grow the business. Key measures of the performance of this team are its mix of skills, its ability to navigate uncertainty, its cohesion in respect to decision making (balancing the need for a leader as well as the empowered expertise of team members) and previous familiarity with working together.</p>\n&lt;</div>\n\n<div>\n<h3>2.5 BALANCE AND INTEGRITY</h3>\n\n<p><strong>Psychological Balance</strong> Psychological balance refers to the integration of the team. Along with their skills, does the team demonstrate psychological balance.</p>\n\n<p><strong>Team structure</strong> Team structure refers to structural characteristics of the team- do they have the skills required to both build the product, understanding the value it provides the customer, and then deliver this to the target market.</p>\n\n<p><strong>Personal Integrity</strong> Personal Integrity is a difficult measure to articulate, but it is assessed by potential investors. Can the entrepreneur demonstrate a reliable history of performance in other businesses or professional roles. Equally one of the most used measures of this is introduction and endorsement from a known contact. Does the entrepreneur have a credible connection with a relevant third party.</p>\n</div>\n</div>\n\n<div>\n<h2>3 RESOURCES</h2>\n\n<div>\n<h3>3.1 BOOTSTRAPPING</h3>\n\n<p><strong>Historical record</strong> What data does the company have about past performance? For an established business, this is a measure of detail in record keeping and data collection. For a new business, this is more a measure for how the business is going to collect data on key metrics.</p>\n\n<p><strong>Private equity</strong> Private equity refers to capital injection of individuals into the business for a shareholding. Private equity is not traded on a public exchange.</p>\n</div>\n\n<div>\n<h3>3.2 EXTERNAL PEOPLE</h3>\n\n<p><strong>External Management Support</strong> External management support refers to the amount and strength of relationships management has with key external advisors. Networks are an important determinant of success, and having a network of expert advisors specifically relevant to the business opportunity can be a big advantage.</p>\n\n<p><strong>Future Support</strong> How reliable is future support from an external network of advisors- can the founders of the business demonstrate a credible relationship with external advisors that is suggestive of ongoing contact.</p>\n</div>\n\n<div>\n<h3>3.3 BUSINESS PLANNING</h3>\n\n<p><strong>Business Plan</strong> Planning document that provides outline of proposed business, articulating business objectives as well as strategy for business performance.</p>\n\n<p><strong>Marketing strategy addressed?</strong> Does the business have a clear marketing plan that provides insight into coverage of the marketing mix.</p>\n\n<p><strong>Strategy Congruence</strong> How consistent is strategy over the business plan- are there inconsistencies or contradictions in strategy or detail- a common expression of this, is &#39;does the business plan hang together&#39;.</p>\n\n<p><strong>Plan developed by the team</strong> Who created the plan- can the team demonstrate they have detailed understanding of the content of the plan, and offer insight consistent with what is presented.</p>\n</div>\n\n<div>\n<h3>3.4 FINANCIAL</h3>\n\n<p><strong>Current Financial Needs</strong> What amount of money does the business need in its current phase.</p>\n\n<p><strong>Future Financial Needs</strong> What amount of money does the business need to fund its future requirements. This can be 12-36 months in advance depending on the focus of strategy for the business.</p>\n</div>\n</div>\n\n<div>\n<h2>4 FIT</h2>\n\n<div>\n<h3>4.1 TEAM, RESOURCES, &amp; OPPORTUNITY</h3>\n\n<p><strong>Goal and Fit</strong> Goal and fit is an assessment of the goals of the business (as well as industry choice, strategy etc.) in comparison to the skills and experience of the founder. Can the founder and team demonstrate detailed understanding and experience relevant to running and growing the business. Most founders undervalue the role of experience, until they have it.</p>\n\n<p><strong>Upside/Downside Issues</strong> Upside/downside issues relates to the intrinsic value and volatility of the opportunity- if the business is to go badly, what is potential liability or loss. If the business is to go well, what is the potential gain. An investor will not risk capital on a business idea that has small upside, but potentially large downside. Investors are looking for opportunities where the downside (risks of loss) are small, and upside (opportunities for gain) are disproportionately large.</p>\n\n<p><strong>Resources Availability</strong> How well placed is the business to access to the resources it requires. If there is a strong state of market competition for resources, how does the business plan to access key resources (such as people, financial etc.).</p>\n\n<p><strong>Resource Appropriateness</strong> Does the business have appropriate resources to execute strategy for this particular business opportunity. This can be viewed in respect to the make up of the skills of the team, financial and physical resources, as well as tacit resources such as experience and external networks.</p>\n\n<p><strong>Opportunity/Resource relationship</strong> How dependent is the entrepreneur or teams success dependent upon key resources. Does the business have the capacity to capture and control these resources, in a way that allows them to execute the strategy effectively.</p>\n</div>\n</div>\n\n<div>\n<h2>5 ENVIRONMENT</h2>\n\n<div>\n<h3>5.1 POLITICAL / GOVERNMENT / REGULATORY</h3>\n\n<p><strong>Political Sensitivity</strong> Is the business in an industry or offering a product that is politically sensitive, where the size and nature of the opportunity is influenced or perhaps even defined by a political process. For example, think of the effect of Solar panel rebates on the Solar industry.</p>\n\n<p><strong>Political Patronage</strong> Does the business have a relationship and understanding of the political environment that impacts upon the business.</p>\n\n<p><strong>Government Legislation</strong> Government legislation refers to specific legislation that impacts upon the strategy and operation of the business. Legislation can be both a source of opportunity as well as risk for a particular business.</p>\n\n<p><strong>Environmental Legislation</strong> Environmental legislation refers to specific environmental legislation that impacts upon how the business operates. It is a requirement of the business to be aware of and adhere to this legislation. This legislation can be a source of cost, but also opportunity if the business can establish cost advantage in comparison to competition or can use environmental impact reputation as a key marketing advantage.</p>\n\n<p><strong>Specific Regulations</strong> Is the business governed by an specific regulation unique to the particular industry. Is the entrepreneur aware of these, and are these specific regulations reflected in appropriate strategy.</p>\n\n<p><strong>Specifications</strong> Must the product be constructed to designated specifications (think of car emission standards or energy efficiency ratings). Is the entrepreneur aware of these, and are these specifications reflected in appropriate strategy.</p>\n\n<p><strong>Quota Protection</strong> Quota protection refers to a Government imposed trade restriction that constrains the amount of goods that can be imported or exported in a particular time frame. Can the business establish an advantage in respect to quota protection, or are the risks identified.</p>\n\n<p><strong>Tariff Protection</strong> Tariff protection refers to Government imposed taxes often on foreign imports that offers cost advantage to local industry. For local industries, tariffs can be a source of advantage. For those businesses exporting into these markets they are a source of risk. Does the business have an appropriate strategy for these conditions, as well as potential changes.</p>\n</div>\n\n<div>\n<h3>5.2 ECONOMIC</h3>\n\n<p><strong>Foreign Exchange</strong> In the context of business planning, foreign exchange relates to risks and opportunities as a result of different currencies. Currency differences can offer advantage and risk to the business in respect to overseas suppliers, customers, distribution channels etc. If operating in international markets, does the business have a foreign currency strategy.</p>\n\n<p><strong>&quot;Hot Industry&quot; identification</strong> Is the business entering a particular industry that has been a focus in press as well as VC investment. What impact does this have on the businesses ability to secure required resources, stand out from competition etc. Equally is the entrepreneur entering this business because of attention, or do they have appropriate history. In the absence of this focus, how does the business establish interest in it. (e.g. It&#39;s easier for Google or Facebook to hire talented developers compared to a local waste management company).</p>\n\n<p><strong>Economic Conditions</strong> Economic conditions refers to the macro economic conditions that impact upon the business. This has an effect on business valuation, access to resources (such as lending interest rates etc., as well as state of VC and angel market), customer spending etc. Ultimately though, the business should be able to describe the business opportunity independent of these conditions. Apple and Microsoft were both founded during a recession.</p>\n</div>\n\n<div>\n<h3>5.3 SOCIAL &amp; ATTITUDINAL</h3>\n\n<p><strong>Social Environment</strong> Social environment refers to the professional network of the entrepreneur. This is major asset for the business, and the absence of it can have a direct impact upon performance.</p>\n\n<p><strong>&quot;Hot Industry&quot; identification</strong> Is the business entering a particular industry that has been a focus in press as well as VC investment. What impact does this have on the businesses ability to secure required resources, stand out from competition etc. Equally is the entrepreneur entering this business because of attention, or do they have appropriate history. In the absence of this focus, how does the business establish interest in it. (e.g. It&#39;s easier for Google or Facebook to hire talented developers compared to a local waste management company).</p>\n</div>\n\n<div>\n<h3>5.4 TECHNOLOGICAL</h3>\n\n<p><strong>Broad Environment</strong> Is the business aware of the broad environmental changes in technology, and is the business utilizing these to maximize resource efficiency in the business- this can relate to things like what software tools the business employs to coordinate staff and communication, access overseas suppliers etc.</p>\n\n<p><strong>Infrastructure</strong> Does the business require any specific technological infrastructure to create the product, or will this business be impacted by the emergence of a future infrastructure.</p>\n</div>\n</div>\n</div>\n\";}','2017-07-28 09:01:55','2017-07-28 09:03:21','raw_content','true',-1,-1,'','',42,'10018'),(41,'Mailer Setting','mailer-setting','a:10:{s:4:\"host\";s:13:\"223.27.22.183\";s:4:\"port\";s:2:\"25\";s:10:\"smtpsecure\";s:0:\"\";s:8:\"smtpauth\";s:1:\"1\";s:7:\"mailler\";s:4:\"smtp\";s:8:\"username\";s:21:\"noreply@risk90.com.au\";s:8:\"password\";s:11:\"noreply@123\";s:6:\"sender\";s:7:\"Risk 90\";s:6:\"mailer\";s:4:\"smtp\";s:6:\"active\";s:1:\"1\";}','2017-07-20 14:23:23','2017-07-30 13:48:57','mailler','true',-1,-1,NULL,NULL,40,'10018'),(47,'Terms & Conditions','terms-conditions','a:1:{s:7:\"content\";s:7889:\"<h2>Privacy Policy</h2>\n\n<p>This policy was last updated on 28st February 2017 and sets out Ready Ninety&rsquo;s (CPP ABN:) policies relating to management of your personal information. These policies are based on our obligations under the Privacy Act 1988 (Commonwealth) including the Australian Privacy Principles.</p>\n\n<p>By voluntarily supplying us with your personal information, you are agreeing to be bound by the Policy. This policy is periodically reviewed and any amendments will be posted to our website. Note that Ready Ninety&rsquo;s website and Facebook page contain links to other websites. When a user has clicked on a link to another site, they leave the Ready Ninety&rsquo;s site and are no longer protected by this Policy.</p>\n\n<h3>Collection of Information</h3>\n\n<p>Ninety Ready collects and/or holds the following kinds of personal information:</p>\n\n<p>1. contact information such as name, address, email address and telephone numbers;<br />\n2. education and employment information, work history, information related to career development;<br />\n3. any other information voluntarily provided by you, including through our website or social media;<br />\n4. information is collected by Ninety Ready via correspondence from you or your company. This may be via the telephone, social media, email, mail, fax or directly through our website.</p>\n\n<h3>What do we use your personal information for?</h3>\n\n<p>Personal information is collected, held, used and disclosed by Ninety Ready for the following purposes:</p>\n\n<p>1. to provide further information about Ninety Ready and the services we provide and any other information&nbsp;you may require from time to time;<br />\n2. to market or promote our services directly to individuals, businesses and other potential stakeholders and/or partners (unless otherwise requested);<br />\n3. to resolve a complaint;<br />\n4. to develop and or provide products and services that may interest you;<br />\n5. to personalise your experience with Ninety Ready;<br />\n6. to improve our website and customer service;<br />\n7. to provide data and information to funding bodies to meet contractual obligations; and<br />\n8. for other related purposes.</p>\n\n<h3>How do we collect and hold your personal information?</h3>\n\n<p>Ninety Ready collects the information voluntarily supplied by you through our website enquiry forms and when we&nbsp;provide our services to you. If the personal information is not collected, we may not be able to provide you with&nbsp;the products or services we offer.</p>\n\n<p>Ninety Ready holds all personal information in electronic and/or physical form. We store information in access controlled&nbsp;premises and in electronic databases requiring logins and passwords.</p>\n\n<h3>How do we protect your personal information?</h3>\n\n<p>Ninety Ready is committed to keeping secure the personal information you provide us and we will take all reasonable&nbsp;precautions to protect your personally identifiable information from loss, misuse, interference, unauthorised&nbsp;access or alteration.</p>\n\n<p>We aim to achieve this through:</p>\n\n<p>1. imposing confidentiality requirements on our employees;<br />\n2. implementing policies in relation to document storage security;<br />\n3. implementing security measures to govern access to our systems;<br />\n4. only providing access to personal information once proper identification has been given;<br />\n5. controlling access to our premises; and<br />\n6. implementing website protection measures.</p>\n\n<h3>When do we disclose and how do we use personal information?</h3>\n\n<p>Ninety Ready has a duty to keep our customers&rsquo; personal information confidential. Our duty of confidentiality applies except where we have consent to disclose personal information, the disclosure is permitted under the APPs or is&nbsp;compelled by law.</p>\n\n<p>Ninety Ready will only use your personal information for the purposes for which it was collected (&ldquo;primary purposes&rdquo;)&nbsp;or a purpose related to the primary purpose, if this use would be reasonably expected by you, or otherwise, with&nbsp;your consent.</p>\n\n<p>We may disclose your personal information to necessary third parties, who assist us to provide, manage and&nbsp;administer our services and products. In which case, your personal information will be dealt with in accordance&nbsp;with that entity&rsquo;s privacy policy.</p>\n\n<h3>Legal</h3>\n\n<p>We reserve the right to disclose your personally identifiable information as required by law and when we believe that disclosure is necessary to protect our rights and/or comply with a judicial proceeding, court order, or legal process served on our Website.</p>\n\n<h3>How can you seek access to and correction of your personal information?</h3>\n\n<p>You can contact us at any time to request access to your personal information or for your personal information to&nbsp;be corrected or updated. Please direct your request to the Privacy Officer via the details provided in this Policy.</p>\n\n<p>Ninety Ready will, on request, provide you with access to your personal information or update or correct your personal&nbsp;information, unless the APPs provide an exception to us granting your request. Your request for access to your personal information or to update or correct your personal information will be&nbsp;dealt with by the Privacy Officer as soon as reasonably practicable. If we deny your request, we will provide you&nbsp;with a written notice detailing reasons for the refusal and the process for making a complaint about the refusal to&nbsp;grant your request. Upon accepting a request for correction of your personal information, we will take all steps that are reasonable in&nbsp;the circumstances, having regard to the purpose for which your personal information is held, to correct your&nbsp;personal information.</p>\n\n<h3>Dealing with us anonymously</h3>\n\n<p>You can deal with Ninety Ready anonymously or using a pseudonym when making a general enquiry about the services that we can offer you. However if you wish to access the services we provide, you will be required to provide your personal contact information.</p>\n\n<p>You may request at the start of any telephone call with us, in relation to a general enquiry, to remain anonymous&nbsp;(or you may use a pseudonym). You will also be given the opportunity to remain anonymous or use a pseudonym&nbsp;when completing a website enquiry form.</p>\n\n<h3>Complaints</h3>\n\n<p>If you believe that Ninety Ready has breached a term of this Policy or the APPs, you may submit a written complaint.</p>\n\n<p>The written complaint can be emailed or posted to us using the contact details set out below. You must include&nbsp;contact details for us to contact you regarding your complaint. Our Privacy Officer will consider your complaint and respond as soon as reasonably possible, but not more than&nbsp;30 days from receiving the complaint. If you remain dissatisfied with the outcome, you may&nbsp;refer your complaint to the Office of the Australian Information Commissioner to be resolved.</p>\n\n<h3>Contact Us</h3>\n\n<p>If you wish to:</p>\n\n<p>1. gain access to your personal information<br />\n2. make a complaint about a breach of your privacy<br />\n3. contact us with a query about how your personal information is collected or used<br />\n4. contact us regarding any other matter concerning this Policy</p>\n\n<p>you can speak directly with our staff who will do their best to try to resolve your issue as simply as possible.</p>\n\n<p>Alternatively, you can write to us or send us an email so that our Privacy Officer can consider the matter (details below). We will&nbsp;respond to you as soon as reasonably possible.</p>\n\n<p><strong>Privacy Officer</strong> &ndash; Andrew Bensley, P: 61+ 08 8269 3795, Ready Ninety, 4 Iona Street Broadview South Australia 5083</p>\n\n<p>admin@ninetyready.com</p>\n\";}','2017-07-28 09:02:25','2017-07-28 09:00:56','raw_content','true',-1,-1,'','',43,'10018'),(42,'App Information','app-information','a:1:{s:7:\"content\";s:2111:\"<div class=\"raw-info\"><img class=\"logo\" src=\"http://rawninety.com.au/sites/all/themes/bootstrap/bootstrap_subtheme/raw90_logo.png\" /> VERSION 1.0</div>\n\n<p>So you have purchased the Raw90&deg;app! Well done. You now have in the palm of your hand the go-to opportunity assessment app used by entrepreneurs, innovators, SME&rsquo;s and start-ups all over the world.</p>\n\n<p>Raw90&deg; will allow you as an individual or as a team to assess the strengths and weaknesses of your next venture. Based on over 40 years of quantitative research, from some of the world&rsquo;s leading experts in the fields of entrepreneurship, commercialisation and innovation, Raw90&deg; will ask the hard questions every successful venture needs to be able to answer.</p>\n\n<p>Raw90&deg; is currently being utilised by The University of Adelaide&rsquo;s Entrepreneurship MOOC (Massive Online Open Course), hosted on the Harvard and MIT edX Platform</p>\n\n<p>The Raw90&deg; advantage:</p>\n\n<p>● Over 100 questions from key categories including Opportunity, Team, Resources and Environment</p>\n\n<p>● Responses plotted against a target base score on easy to read radar graphs</p>\n\n<p>● Graphs clearly define the strengths and weaknesses of the venture against the base correct practice methodology</p>\n\n<p>● Insightful and directional feedback given to all responses</p>\n\n<p>● Easy to share your project, graphs and outcome information with team members</p>\n\n<p>● Up to 5 team member&rsquo;s input data can be overlaid in radar graphs for comparison of strengths and weaknesses of venture</p>\n\n<p>Raw90&deg; is part of a suite of apps developed under the 90&deg;Ready brand, which have been created to help entrepreneur&rsquo;s, startup&rsquo;s and SME&rsquo;s, to have a clearer understanding of a venture&rsquo;s strengths and weaknesses. Our aim is to ensure your next project is 90&deg;Ready, that&rsquo;s a 90&deg; trajectory heading in the right direction for financial success.</p>\n\n<p>Have a question, problem, or feedback? Reach out to us at <a href=\"mailto:feedback@ninetyready.com\">feedback@ninetyready.com</a></p>\n\";}','2017-07-28 09:00:56',NULL,'risk_content','true',-1,-1,NULL,NULL,41,'10018'),(43,'Terminology Database','terminology-database','a:1:{s:7:\"content\";s:44493:\"<div>\n<div>\n<h2>1 OPPORTUNITY</h2>\n\n<div>\n<h3>1.1 TARGET MARKET</h3>\n\n<div>\n<h4>1.1.1 Target Market Size</h4>\n\n<p><strong>Current Market Size</strong> Current market size is a measure of the total volume of a given market. It can either be expressed as amount of individual customers, of units sold, or revenues resulting from the amount of the particular goods sold.</p>\n\n<p><strong>Market Size Potential</strong> Market size potential is the forecast maximum size of the market. Like current market size, it can be expressed as individual customers, potential units sold, or revenues.</p>\n\n<p><strong>Market Growth Rate</strong> Market growth rates refers to the increase in size of the market over a designated time period (normally quarterly, half yearly or annually). This figure refers to the market as a whole, including all competitor products.</p>\n\n<p><strong>Local Market Share Attained</strong> Location market share attained refers to the amount (often expressed as a percentage) of the total market the business has captured in a specific geographic location.</p>\n\n<p><strong>International Market Share Attained</strong> International market share attained refers to the amount (often expressed as a percentage) of the total market the business has captured internationally.</p>\n\n<p><strong>Domestic Market Share Attainable</strong> Domestic market share attainable refers to the amount (often expressed as a percentage) of the total market the business has yet to capture within a specified geographic location, and which based on strategic analysis it believes is possible to attain.</p>\n\n<p><strong>International Market Share Attainable</strong> International market share attainable refers to the amount (often expressed as a percentage) of the total market the business has yet to capture internationally, and which based on strategic analysis is believes is possible to attain.</p>\n</div>\n\n<div>\n<h4>1.1.2 Market Structure</h4>\n\n<p><strong>Market Structure: Niches</strong> Market niche is a specific customer grouping or segment that has particular and unique characteristics compared to the larger market. The entrepreneur designs the product to meet the preferences of the specific niche (in respect to pricing, features, availability and distribution and so on).</p>\n\n<p><strong>Industry Life Cycle</strong> Industry life cycle refers the stages the product category will go through, from inception with first products growing through to maturity with a larger range of competitors offering more sophisticated products, eventually dying as the product category gets replaced by a newer product category often constructed from a new technology. A good example is Kodak and film cameras, being replaced by digital cameras.</p>\n\n<p><strong>Dependence on other products</strong> Dependence on other products is a measure of interdependency. Does the product require support products in order to provide complete value to a customer. For example, the value of a motorcar is dependent on support products such as roads and more specifically extensive refueling networks.</p>\n\n<p><strong>Window of Opportunity</strong> A window of opportunity refers to a momentary opportunity where the capacity for performance and innovation greatly increases in comparison to other times. A window of opportunity may be created by a current unfulfilled customer need, a temporary capacity of a technology, or the state of competition. Implicit in the idea of a window is that these conditions are limited and will recede or disappear based on changing factors.</p>\n\n<p><strong>Window Duration</strong>Window duration is a forecast of the amount of time the entrepreneur has to capitalize on favorable conditions, before the window of opportunity will close.</p>\n\n<p><strong>Market Capacity: Products</strong>Market capacity refers to the amount of similar products that can be sustained by the market.</p>\n</div>\n\n<div>\n<h5>1.1.2.1 Competitors</h5>\n\n<p><strong>Number of Competitors </strong> How many direct competitors are there currently in the market, offering similar producst to the business in focus.</p>\n\n<p><strong>Competitor Strength</strong> Competitor strength assesses the capacity of competition in respect to their capacities to create, market and distribute the particular relevant product to the market.</p>\n\n<p><strong>Competitor Reputation</strong> Competitor reputation describes any advantage or disadvantage of competitors related to their reputation. This may accrue from previous customer history, alternative products. It results in brand recognition and loyalty (or the opposite).</p>\n</div>\n\n<div>\n<h5>1.1.2.2 Customers</h5>\n\n<p><strong>Customer Need</strong> Customer need refers to the problem that the product solves for the customer, or the benefit it delivers to the customer.</p>\n\n<p><strong>Customer Existence</strong> Customer existence refers to the familiarity and use of the product by a target customer- can an identifiable pre existing customer base be identified, or is this a new product that is creating a new customer behavior.</p>\n\n<p><strong>Number of Key Customers</strong> Number of key customers refers to the identification of critical customers that have a disproportionately large effect on overall performance of the business. These customers can have an important position in the market due to the nature of the target market, or due to their credibility as a referral source for other customers.</p>\n\n<p><strong>Market Capacity: Customers</strong> Market capacity refers to the amount of similar products that can be sustained by the market.</p>\n\n<p><strong>Customer Dependence</strong> Customer dependence refers to the risks associated with the business having to rely on too few or too powerful customers.</p>\n\n<p><strong>Bargaining Power of Customers</strong> Bargaining power of customers refers to the pressures consumers can exert on a business, largely driven by choice, related to quality, features or price.</p>\n\n<p><strong>Rent Roll</strong> A rent roll situation results when, after the initial sale is made, there is a compelling reason for customers to come back and buy the product or related product(s) again and again. For example, once a photocopier is sold, there is a need to purchase ink cartridges on an ongoing basis for that photocopier.</p>\n\n<p><strong>Rent Roll Capability</strong> Rent roll capability refers to the likelihood or otherwise of the business to establish a product that offers secondary income streams related to rent rolls.</p>\n\n<p><strong>Customer Contracts</strong> Customer contracts refers to the contract related to a negotiated ongoing payment relationship with the customer. Common examples are a mobile phone contract, or a financed car purchase contract.</p>\n\n<p><strong>Customer Contracts</strong> Customer contracts refers to the contract related to a negotiated ongoing payment relationship with the customer. Common examples are a mobile phone contract, or a financed car purchase contract.</p>\n\n<p><strong>Target Market Focus</strong> Target market focus refers to the tailoring of the design of the product (in respect to features such as performance, price, distribution etc.) to match the preferences of a specific target market. Consumer adoption is a choice of perceived value, and if the product has not been designed for a specific target market, it is unlikely to be adopted based on the failure to appreciate specific preferences.</p>\n\n<p><strong>Customer Payback</strong> Customer payback refers to the time it take to recoup investment to acquire the customer. Costs such as marketing must be spent up front before revenues. Customer payment is a measure of the time until expenses are recouped.</p>\n\n<p><strong>Basis for Growth Strategy Existence</strong> How realistic are the forecasts related to growth, and what is the relationship between the accuracy of the forecasts and the viability of the business.</p>\n\n<p><strong>Basis for Growth Strategy Suitability</strong> Is the growth strategy suitable for the business dependent upon the market, the type of product (technology), team and stage of available resources.</p>\n</div>\n\n<div>\n<h4>1.1.3 Pricing</h4>\n\n<p><strong>Price</strong> The purchase price of the good. The willingness for customers to pay a certain price is relative to the value the product delivers to a particular user.</p>\n\n<p><strong>Price Sensitivities</strong> Price sensitivities refers to the price range the customer is willing to pay. If the range is short, then it is said the customer is price sensitive. If the customer is tested and prepared to buy the product over a wide range of prices then the customer is said to be insensitive to price (offering higher margins- think of Rolls Royce pricing).</p>\n\n<p><strong>Marketing and Distribution Costs</strong> Marketing and distribution costs refer to the costs related to marketing (informing potential customers of your product) and distribution (the way in which the customer receives your product).</p>\n\n<p><strong>Degree of Control over Price Setting - Price Maker</strong> Degree of control over price setting refers to the state of price competition, as well as if the business is viewed as an authority by the target demographic.</p>\n\n<p><strong>Degree of Control over Costs</strong> Degree of control over costs refers to the power or authority that the business has in respect to key suppliers.</p>\n\n<p><strong>Degree of Control over Distribution Channels</strong> Degree of control over distribution channels refers to the authority the business has over key distribution channels. For example, a food business reliant on Woolworths or Coles has little control. Whereas Ikea designs its own products as well as controls the stores where they are sold.</p>\n\n<p><strong>Price elasticity</strong> Price elasticity is a measure of the effect of a price change on the demand for a product.</p>\n\n<p><strong>Pricing policy</strong> Pricing policy refers to the strength and detail in the underling pricing strategy for the business.</p>\n\n<p><strong>Price maker</strong> Price maker refers to a position where a company has entered a new market, or is seen as an authority in an existing market, and has the capacity to set prices themselves, with less regard for the relative price to competitors.</p>\n</div>\n</div>\n\n<div>\n<h3>1.2 PRODUCT</h3>\n\n<div>\n<h4>1.2.1 Product Characteristics</h4>\n\n<p><strong>Product Diversification</strong> Has the business the capacity to offer a diversified product range, rather than just a single product. This can aid consumer repeat purchases, as well as offering more feedback regarding consumer preferences in the early stage.</p>\n\n<p><strong>Substitute Products</strong> Substitute products are two or more products that could be used for the same purpose.</p>\n\n<p><strong>Complimentary Products</strong> A complimentary good is a good whose perceived value can change as a result of the presence of a related product. The sale of combustion engine cars for example, has a complimentary relationship with petrol stations.</p>\n\n<p><strong>Product Addiction</strong> Product addiction refers to the repetitive nature of the value your product provides the customer. How often is a customer actively using your product.</p>\n\n<p><strong>Product Safety</strong> Product safety describes the potential hazards with the use of the product, as well as the potential customer learning curve related to use.</p>\n\n<p><strong>Novelty</strong> A novel product is one that has few precedents, and establishes a new market or a new consumer behavior.</p>\n\n<p><strong>No of dependent suppliers</strong> Dependent suppliers describes the relationship the business has to supplier markets. The more dependent suppliers the business has available to them, the greater the businesses bargaining position.</p>\n\n<p><strong>Product waste</strong> Product waste describes the waste related to product manufacture, or waste created by the product in use. For example, packaging of the product often is discarded waste- and must meet safety and waste standards.</p>\n\n<p><strong>Ease of disposal</strong> Ease of disposal relates to obsolescence- are there any hazards related to disposal of the product, or does the business provide consumers any processes for disposal?</p>\n</div>\n\n<div>\n<h4>1.2.2 Process</h4>\n\n<p><strong>Complexity of Production Process</strong> Complexity of production process describes the difficulty of production. The complexity is represented in things such as the capital intensity of production equipment, production lead times, amount and stability of component producers, the role of automation and so forth.</p>\n\n<p><strong>Quantity of inputs needed</strong> How many inputs or components are needed to create the product. Does it require coordination of many independent suppliers. Does the business have control or leverage over these relationships.</p>\n\n<p><strong>Service or Product Business</strong> Does the business sell customers a service, or a product. Service businesses sell a less tangible product, making production costs harder to estimate (or at least variable costs) as well as pricing more dynamic. Product businesses generally are margin businesses, where profit margins and volume are important.</p>\n\n<p><strong>Storage requirements</strong> Storage requirements relate to inventory, both of finished goods, or components. Perishability, security, depreciation are issues, as well as capital lock up as a result of holding inventory are all considerations here.</p>\n</div>\n</div>\n\n<div>\n<h3>1.3 SUSTAINABLE COMPETITIVE ADVANTAGE (SCA)</h3>\n\n<div>\n<h4>1.3.1 Production Issues</h4>\n\n<p><strong>Low Cost Producer</strong> Can the company produce their goods or services at a low cost. This will result in pricing flexibility- higher retail prices will give higher margins, or the company can compete on cost with a lower retail price and larger volumes.</p>\n\n<p><strong>Cost Advantage</strong> Can the business achieve a production or distribution cost advantage relative to other competitors in the market, that allow them to achieve better profit margins or lower retail cost.</p>\n\n<p><strong>Scalability</strong> Does the business have the capacity to scale production or management in the event of increased demand. What level of redundancy does the business currently have in respect to their capacity.</p>\n\n<p><strong>Scalability Competitive Advantage</strong> What effect does operating at larger scale have on the business. A scalability competitive advantage would relate to situations where increased volume would have a positive effect on performance- such as offering economies of scale leading to higher production margins. Competitive advantage can emerge at scale from other parts of the business too, such as relationship with key suppliers, distribution channels etc.</p>\n\n<p><strong>Finished Goods Inventory levels (1)</strong> Finished good inventory refers to goods that have been produced, and awaiting deployment to distribution channels, or potentially have already been sold to customers.</p>\n\n<p><strong>Finished Goods Inventory levels (2)</strong> Finished good inventory refers to goods that have been produced, and awaiting deployment to distribution channels, or potentially have already been sold to customers.</p>\n\n<p><strong>Inventory Levels</strong> The current level of inventory of finished goods of the business. This can also refer to component inventory levels as an important measure of current production ability.</p>\n\n<p><strong>Raw material cost</strong> Raw material cost refers to the cost of the basic materials from which the product is made. What the components of the product, and what are their current cost. This can fluctuate over time based on wider market conditions, as well as competition. Basic materials cost has an effect on production margins.</p>\n\n<p><strong>Technology Innovation</strong> Technology innovation refers to the implementation of new technologies that provide customers or the business a new form of value (increased efficiency, better customer experience in terms of lower cost or higher quality distribution choices etc.)</p>\n\n<p><strong>Production Innovation</strong> Production innovation refers to new production methods that provides increased value (better quality manufactured goods, or related to the delivery of the same goods at increased efficiency- lower prices, less materials etc.).</p>\n\n<p><strong>Cost of flexibility</strong> What trade offs has the business made in respect to cost structure. Does the business have low flexibility by controlling assets, with higher fixed costs and lower marginal costs, or does the business have high flexibility renting assets and paying a premium marginal cost for the flexibility.</p>\n</div>\n\n<div>\n<h4>1.3.2 Product Differentiation</h4>\n\n<p><strong>Satisfied Customers</strong> Does the business have a past track record with customers, and if so can the business gain customer endorsement. In the earliest stages of the business, this should be a focus, even at the prototype stage, prior to launch. Engagement with customers is the single biggest proof a business can give of customer response to the product. It is the job of entrepreneurs to get direct feedback as early and often as possible.</p>\n\n<p><strong>Complimentary Products</strong> Complimentary products refer to associated products whose presence can have a direct effect on the perceived value of the product of the business.</p>\n\n<p><strong>No of intermediaries </strong> No of intermediaries refers to the length of distribution channel, and the number of intermediaries between the business and the customer. Each intermediary often will bring with it an increase in cost of the product.</p>\n\n<p><strong>Competing Products</strong></p>\n</div>\n\n<div>\n<h4>1.3.3 Strategic Partnerships</h4>\n\n<p><strong>Endorsements</strong> Is there any businesses that are willing to endorse the business. Often employed as a legitimation strategy for young businesses, if the business can achieve endorsement from key customers with prominent reputations, or via key suppliers, this can improve the likelihood of adoption of the product.</p>\n\n<p><strong>Number of Supply Channels</strong> Does the business have a range of suppliers, or is the business dependent (and vulnerable) on a particular supplier. Conversely, having a single supplier might have an advantage, if a cost advantage can be achieved.</p>\n\n<p><strong>Established Strategic Alliances</strong> What relationships does the business have (or plan to have) with associations or alliances that can aid the businesses legitimacy or offer switching costs.</p>\n\n<p><strong>No of Distribution Channels</strong> How does the business sell to the customer? Are there a range of distribution channels utilized or does the business have a singular distribution focus? Decisions must be justified.</p>\n</div>\n\n<div>\n<h4>1.3.4 Barriers to Entry/Exit</h4>\n\n<p><strong>Location</strong> Location offers particular advantages and disadvantages for the business. These may relate to cost of labor, proximity to the target market, time issues with overseas suppliers and so forth. Equally, for direct to customer retail operations, location is a critical decision.</p>\n\n<p><strong>Lead time advantage</strong> Can the business establish an advantage over competition in respect to manufacturing and distribution time for orders.</p>\n\n<p><strong>Brand Loyalty</strong> Has the business (or can the business) establish brand loyalty. Ideally through word of mouth and repeat purchases, but also aided by marketing. It is possible for early market entrants to build brand loyalty cheaply. For late market entrants, often it requires inflated marketing efforts.</p>\n\n<p><strong>Legal/Contractual Advantages</strong> Can the business establish advantages related to contracts with key suppliers or distribution channels. For example, can the business create an exclusive license with a key component supplier.</p>\n\n<p><strong>High Capital Costs</strong> Is the product and business capital intensive, both in respect to establishment costs as well as ongoing activity (compare for example, the capital cost of establishing a mining business compared to a coffee shop).</p>\n\n<p><strong>Specialist Skills</strong> Does the entrepreneur or entrepreneurial team have identified unique specialist skills that could be the source of advantage, with that advantage not being accessible by competitors. This may be an expert in research or emerging science.</p>\n\n<p><strong>Transportation Costs</strong> Transport costs refer to the costs associated with getting the product from manufacturing location to distribution location.</p>\n\n<p><strong>Market Structure (1)</strong> Market structure refers to the state of competition in the market, whether there exist clear established leaders, or whether there is opportunity for first mover advantages.</p>\n\n<p><strong>Market Structure (2)</strong> Market structure refers to the state of competition in the market, whether there exist clear established leaders, or whether there is opportunity for first mover advantages.</p>\n</div>\n\n<div>\n<h4>1.3.5 Research &amp; Development</h4>\n\n<p><strong>R&amp;D Dependency</strong> R&amp;D Dependency describes the relationship between the final product and research and development- does the product require R&amp;D, what lead times are expected for commercialization of R&amp;D, how dependent is commercialization on the current state of R&amp;D.</p>\n\n<p><strong>R&amp;D Program</strong> Does the business have/require a Research and Development program. What plans does the business have for this, including necessary expertise, funding and deadlines.</p>\n\n<p><strong>R&amp;D Funding Levels required</strong> Does the business have a clear plan and understanding of both the work to be done to complete R&amp;D, as well as the financial commitment to fund the research until commercialization.</p>\n\n<p><strong>R&amp;D Funding sufficiency</strong> Does the business have sufficient funding for R&amp;D execution plan.</p>\n</div>\n\n<div>\n<h4>1.3.6 Legal/Contractual</h4>\n\n<p><strong>Technology Ownership</strong> Who owns the proprietary created by the business- that is, does the business have adequate contracts in place with key employees or external stakeholders that sufficiently identifies ownership structure of proprietary technology.</p>\n\n<p><strong>Proprietary Protection</strong> What controls and protections (e.g. patents) does the business have for any proprietary technology they may have created.</p>\n\n<p><strong>Technology Ownership</strong> Who owns the proprietary created by the business- that is, does the business have adequate contracts in place with key employees or external stakeholders that sufficiently identifies ownership structure of proprietary technology.</p>\n</div>\n</div>\n\n<div>\n<h3>1.4 FINANCIAL PERFORMANCE</h3>\n\n<p><strong>Capital Requirements</strong> Capital requirements is the amount of capital a bank or other financial institution has to hold to cover its liabilities.</p>\n\n<p><strong>After Tax Profits</strong> After tax profits is a comparison of net income after taxation to net sales. It provides the business an understanding of their profits per unit after all expenses including tax has been accounted for.</p>\n\n<p><strong>Net Cash Flow</strong> Net cash flow refers to the difference between cash inflow from sales compared to the cash outflow from expenses in a given period. The greater the positive figure, the less risk of the business.</p>\n\n<p><strong>Internal Rate of Return (IRR)</strong> Internal rate of return is a calculation that is used to assess the profitability of the business investment. It is the interest rate at which the net present value of all cash flows from a project equal zero.</p>\n\n<p><strong>Investment Multiple Returned</strong> Investment multiple returned is a measure of the returns paid to an investor. It is a measure of the cumulative dollar amount returned to the investor compared to their investment. It can be used as an outcome or as a projection.</p>\n\n<p><strong>Sales Growth</strong> Sales growth is the amount the sales volume, either in units sold or in revenues, has grown compared to a previous period. Generally sales growth is calculated on a quarterly, half yearly or annual basis.</p>\n\n<p><strong>Working Capital</strong> Working capital is a calculation of current assets minus current liabilities. It represents the capital available to the business to use in operation. It is an important measure of the current capacity of the business to meet responsibilities and remain solvent.</p>\n\n<p><strong>Free Cash Flow (FCF)</strong> Free Cash Flow is the amount of cash the business generates after accounting for all expenditure responsibilities such as rent, wages, and lease arrangements. Free cash can be used to pay dividends to investors, invest in marketing or growth, or can be used to reduce any debt of the business above normal repayments.</p>\n\n<p><strong>Gross Margin</strong> Gross margin is the difference the selling price and the cost of production for the product.</p>\n\n<p><strong>Historical Performance</strong> Historical performance is the past performance of the business in respect to a particularly financial criteria. How does the current performance compared to previous performance. This data is not available to businesses pre launch.</p>\n\n<p><strong>Time to Cash Neutral</strong> Time to cash neutral refers to the amount of time until the business is generating enough income to cover expenses. Most businesses are not cash flow positive initially, but require investment to cover expenses during the cash burn phase until such time as revenues develop.</p>\n\n<p><strong>Time to Profit (Annual)</strong> Time to profit is a time based projection of profit in a particular year. If forward projections suggest profitability is achieved in a particular future month, the time to profit figure is a measure of proximity to profitability on a month by month basis.</p>\n\n<p><strong>Time to Profit (Cumulative)</strong> Time to profit cumulative is a forward projection of when the business will generate a profit, forecast cumulatively.</p>\n\n<p><strong>Time to Breakeven</strong> Time to breakeven represent the amount of time it takes for an investment to make back its original cost.</p>\n\n<p><strong>Cost Structure (Ratio of Fixed to Variable Costs)</strong> Cost structure refers to the amount and relationship of fixed and variable costs the business incurs. Variable cost is a cost that varies with the level of output. A fixed cost is a cost that does not change as a result of level of output.</p>\n\n<p><strong>Gearing</strong> Gearing refers to the ratio of a company&#39;s capital (debt), to the value of its revenues and ordinary shares.</p>\n</div>\n\n<div>\n<h3>1.5 HARVESTABILITY</h3>\n\n<p><strong>Valuation Multiples</strong> Valuation multiple is a measure of market value of the equity relative to the expected future earnings of the business.</p>\n\n<p><strong>Harvest Ability</strong> Harvest ability refers to the potential of the business unit to be sold to an external company.</p>\n\n<p><strong>Exit time period</strong> Exit time period is a transition period after agreement for an exit has been made until the exit is completed.</p>\n\n<p><strong>Exit Strategy</strong> Exit strategy is a specific strategy and forecast of a pre planned exit to the business for the entrepreneurial and investment team.</p>\n\n<p><strong>Exit target</strong> Exit target is a targeted strategy for exit. The most common exit target is a larger competitor or business with a complementary business unit. Google for example buying YouTube is an example. The trade sale is completed by negotiation.</p>\n</div>\n</div>\n\n<div>\n<h2>2 TEAM</h2>\n\n<div>\n<h3>2.1 INVESTOR READINESS</h3>\n\n<p><strong>Control</strong> Control refers to the required proportion of equity to establish control of the business. Ultimately to remain in total control of a business, an equity stake of 51% or above is required. However, if equity is diluted between many shareholders, it may be possible to control the business with a smaller stake, as long as it remains the majority.</p>\n\n<p><strong>Equity</strong> Equity refers to the issued ownership shares of the business. Total equity refers to the total amount of shares issued to shareholders. Equity stake refers to an individuals unique share of the total.</p>\n\n<p><strong>Board</strong> A board of directors is a governing body of the business. Members of the board (recognized as directors) are elected by shareholders. The board has decision making authority for the business.</p>\n\n<p><strong>Independent Chairman</strong> An Independent Chairman is an external individual who is chosen to preside over meetings, as well as key appointments and strategic decisions of the business. They often will not have much role in the day to day operations of the business.</p>\n\n<p><strong>Audit</strong> An audit is an official inspection of the accounts of the business.</p>\n\n<p><strong>Hurt Capital</strong> Hurt money refers to the personal investment position of the founders. Does the entrepreneur stand to gain or lose from the performance of the business. If there is not enough personal entrepreneur investment it may be a sign of belief or commitment to the business.</p>\n</div>\n\n<div>\n<h3>2.2 ENTREPRENEURIAL SKILLS</h3>\n\n<p><strong>Startup and/or Harvest Experience</strong> Startup and harvest experience refers to the previous experience of the entrepreneur or entrepreneurial team. If the entrepreneur or team can demonstrate previous experience (success is best, but failure can also be seen as a positive), they are more likely to gain investment.</p>\n\n<p><strong>Entrepreneurial History</strong> Entrepreneurial experience refers to the previous experience of the founders. Experience helps establish credibility.</p>\n\n<p><strong>Marketing Instinct and Ability</strong> Marketing instinct and ability refers to the ability of the entrepreneur to demonstrate ability to sell. Do they understand the target market and the preferences of the target market when these aren&#39;t particularly obvious at first glance.</p>\n</div>\n\n<div>\n<h3>2.3 FUNCTIONAL SKILLS</h3>\n\n<p><strong>Knowledge of business</strong> Knowledge of the business refers to the depth of understanding the entrepreneur or entrepreneurial team can demonstrate in respect to the proposed business model. This relates to previous experience in the product category or in related categories.</p>\n\n<p><strong>Knowledge of market</strong> Knowledge of the market refers to the depth of understanding the entrepreneur or entrepreneurial team can demonstrate in respect to the characteristics and preferences of the target market. This is one of the most important determinants of success. Can the business, build something the target market wants. And this is driven by understanding and familiarity with the target market.</p>\n\n<p><strong>Industry and Technical Experience</strong> Does the entrepreneurial team have the technical capacity and experience to build a product.</p>\n\n<p><strong>Sales/Marketing Experience</strong> Does the entrepreneurial team have sales and marketing experience relevant to the product? Can they demonstrate understanding of key marketing terms such as inbound and outbound marketing, direct selling, affiliate marketing etc. Do they also understand how to select the most effective marketing method in alignment with the target market.</p>\n\n<p><strong>Distribution Experience</strong> What relevant distribution channel experience does the entrepreneur or entrepreneurial team have. Distribution channel refers to the technology or business intermediaries through which a good is sold onto the end consumer. Does the lead entrepreneur have experience key distribution channels of the business.</p>\n\n<p><strong>Financial Experience</strong> Does the entrepreneurial team have experience in financial management and financial documentation.</p>\n\n<p><strong>Technical Experience</strong> Does the entrepreneurial team have the technical capacity and experience to build a product.</p>\n\n<p><strong>Technical Qualifications</strong> Technical qualifications relevant to any aspect of the business, but primarily with building product.</p>\n\n<p><strong>Functional Knowledge and Skills Balance</strong> Functional knowledge and skills balance refers to the overall depth of knowledge the team has across all business elements, and how well balanced the skill stack of the team is across all elements of the business. Having two technical experts but no marketing expertise would be seen as a weakness compared to a more balanced team.</p>\n\n<p><strong>Bottom Line Responsibility</strong> Is it clear who is ultimately responsible for the performance of the business, and who takes responsibility in light of particular performance outcomes, primarily financial.</p>\n</div>\n\n<div>\n<h3>2.4 LEADERSHIP SKILLS</h3>\n\n<p><strong>Lead Entrepreneur</strong> Lead entrepreneur refers to the single individual who is driving the decisions of the business. Whilst there may be a founding team, It is difficult to lead by committee, and instead great teams have talented individuals in roles that enable them to perform. The lead entrepreneur is viewed as the coordinating function.</p>\n\n<p><strong>Entrepreneurial Team</strong> Entrepreneurial team refers to the team of individuals in place to grow the business. Key measures of the performance of this team are its mix of skills, its ability to navigate uncertainty, its cohesion in respect to decision making (balancing the need for a leader as well as the empowered expertise of team members) and previous familiarity with working together.</p>\n&lt;</div>\n\n<div>\n<h3>2.5 BALANCE AND INTEGRITY</h3>\n\n<p><strong>Psychological Balance</strong> Psychological balance refers to the integration of the team. Along with their skills, does the team demonstrate psychological balance.</p>\n\n<p><strong>Team structure</strong> Team structure refers to structural characteristics of the team- do they have the skills required to both build the product, understanding the value it provides the customer, and then deliver this to the target market.</p>\n\n<p><strong>Personal Integrity</strong> Personal Integrity is a difficult measure to articulate, but it is assessed by potential investors. Can the entrepreneur demonstrate a reliable history of performance in other businesses or professional roles. Equally one of the most used measures of this is introduction and endorsement from a known contact. Does the entrepreneur have a credible connection with a relevant third party.</p>\n</div>\n</div>\n\n<div>\n<h2>3 RESOURCES</h2>\n\n<div>\n<h3>3.1 BOOTSTRAPPING</h3>\n\n<p><strong>Historical record</strong> What data does the company have about past performance? For an established business, this is a measure of detail in record keeping and data collection. For a new business, this is more a measure for how the business is going to collect data on key metrics.</p>\n\n<p><strong>Private equity</strong> Private equity refers to capital injection of individuals into the business for a shareholding. Private equity is not traded on a public exchange.</p>\n</div>\n\n<div>\n<h3>3.2 EXTERNAL PEOPLE</h3>\n\n<p><strong>External Management Support</strong> External management support refers to the amount and strength of relationships management has with key external advisors. Networks are an important determinant of success, and having a network of expert advisors specifically relevant to the business opportunity can be a big advantage.</p>\n\n<p><strong>Future Support</strong> How reliable is future support from an external network of advisors- can the founders of the business demonstrate a credible relationship with external advisors that is suggestive of ongoing contact.</p>\n</div>\n\n<div>\n<h3>3.3 BUSINESS PLANNING</h3>\n\n<p><strong>Business Plan</strong> Planning document that provides outline of proposed business, articulating business objectives as well as strategy for business performance.</p>\n\n<p><strong>Marketing strategy addressed?</strong> Does the business have a clear marketing plan that provides insight into coverage of the marketing mix.</p>\n\n<p><strong>Strategy Congruence</strong> How consistent is strategy over the business plan- are there inconsistencies or contradictions in strategy or detail- a common expression of this, is &#39;does the business plan hang together&#39;.</p>\n\n<p><strong>Plan developed by the team</strong> Who created the plan- can the team demonstrate they have detailed understanding of the content of the plan, and offer insight consistent with what is presented.</p>\n</div>\n\n<div>\n<h3>3.4 FINANCIAL</h3>\n\n<p><strong>Current Financial Needs</strong> What amount of money does the business need in its current phase.</p>\n\n<p><strong>Future Financial Needs</strong> What amount of money does the business need to fund its future requirements. This can be 12-36 months in advance depending on the focus of strategy for the business.</p>\n</div>\n</div>\n\n<div>\n<h2>4 FIT</h2>\n\n<div>\n<h3>4.1 TEAM, RESOURCES, &amp; OPPORTUNITY</h3>\n\n<p><strong>Goal and Fit</strong> Goal and fit is an assessment of the goals of the business (as well as industry choice, strategy etc.) in comparison to the skills and experience of the founder. Can the founder and team demonstrate detailed understanding and experience relevant to running and growing the business. Most founders undervalue the role of experience, until they have it.</p>\n\n<p><strong>Upside/Downside Issues</strong> Upside/downside issues relates to the intrinsic value and volatility of the opportunity- if the business is to go badly, what is potential liability or loss. If the business is to go well, what is the potential gain. An investor will not risk capital on a business idea that has small upside, but potentially large downside. Investors are looking for opportunities where the downside (risks of loss) are small, and upside (opportunities for gain) are disproportionately large.</p>\n\n<p><strong>Resources Availability</strong> How well placed is the business to access to the resources it requires. If there is a strong state of market competition for resources, how does the business plan to access key resources (such as people, financial etc.).</p>\n\n<p><strong>Resource Appropriateness</strong> Does the business have appropriate resources to execute strategy for this particular business opportunity. This can be viewed in respect to the make up of the skills of the team, financial and physical resources, as well as tacit resources such as experience and external networks.</p>\n\n<p><strong>Opportunity/Resource relationship</strong> How dependent is the entrepreneur or teams success dependent upon key resources. Does the business have the capacity to capture and control these resources, in a way that allows them to execute the strategy effectively.</p>\n</div>\n</div>\n\n<div>\n<h2>5 ENVIRONMENT</h2>\n\n<div>\n<h3>5.1 POLITICAL / GOVERNMENT / REGULATORY</h3>\n\n<p><strong>Political Sensitivity</strong> Is the business in an industry or offering a product that is politically sensitive, where the size and nature of the opportunity is influenced or perhaps even defined by a political process. For example, think of the effect of Solar panel rebates on the Solar industry.</p>\n\n<p><strong>Political Patronage</strong> Does the business have a relationship and understanding of the political environment that impacts upon the business.</p>\n\n<p><strong>Government Legislation</strong> Government legislation refers to specific legislation that impacts upon the strategy and operation of the business. Legislation can be both a source of opportunity as well as risk for a particular business.</p>\n\n<p><strong>Environmental Legislation</strong> Environmental legislation refers to specific environmental legislation that impacts upon how the business operates. It is a requirement of the business to be aware of and adhere to this legislation. This legislation can be a source of cost, but also opportunity if the business can establish cost advantage in comparison to competition or can use environmental impact reputation as a key marketing advantage.</p>\n\n<p><strong>Specific Regulations</strong> Is the business governed by an specific regulation unique to the particular industry. Is the entrepreneur aware of these, and are these specific regulations reflected in appropriate strategy.</p>\n\n<p><strong>Specifications</strong> Must the product be constructed to designated specifications (think of car emission standards or energy efficiency ratings). Is the entrepreneur aware of these, and are these specifications reflected in appropriate strategy.</p>\n\n<p><strong>Quota Protection</strong> Quota protection refers to a Government imposed trade restriction that constrains the amount of goods that can be imported or exported in a particular time frame. Can the business establish an advantage in respect to quota protection, or are the risks identified.</p>\n\n<p><strong>Tariff Protection</strong> Tariff protection refers to Government imposed taxes often on foreign imports that offers cost advantage to local industry. For local industries, tariffs can be a source of advantage. For those businesses exporting into these markets they are a source of risk. Does the business have an appropriate strategy for these conditions, as well as potential changes.</p>\n</div>\n\n<div>\n<h3>5.2 ECONOMIC</h3>\n\n<p><strong>Foreign Exchange</strong> In the context of business planning, foreign exchange relates to risks and opportunities as a result of different currencies. Currency differences can offer advantage and risk to the business in respect to overseas suppliers, customers, distribution channels etc. If operating in international markets, does the business have a foreign currency strategy.</p>\n\n<p><strong>&quot;Hot Industry&quot; identification</strong> Is the business entering a particular industry that has been a focus in press as well as VC investment. What impact does this have on the businesses ability to secure required resources, stand out from competition etc. Equally is the entrepreneur entering this business because of attention, or do they have appropriate history. In the absence of this focus, how does the business establish interest in it. (e.g. It&#39;s easier for Google or Facebook to hire talented developers compared to a local waste management company).</p>\n\n<p><strong>Economic Conditions</strong> Economic conditions refers to the macro economic conditions that impact upon the business. This has an effect on business valuation, access to resources (such as lending interest rates etc., as well as state of VC and angel market), customer spending etc. Ultimately though, the business should be able to describe the business opportunity independent of these conditions. Apple and Microsoft were both founded during a recession.</p>\n</div>\n\n<div>\n<h3>5.3 SOCIAL &amp; ATTITUDINAL</h3>\n\n<p><strong>Social Environment</strong> Social environment refers to the professional network of the entrepreneur. This is major asset for the business, and the absence of it can have a direct impact upon performance.</p>\n\n<p><strong>&quot;Hot Industry&quot; identification</strong> Is the business entering a particular industry that has been a focus in press as well as VC investment. What impact does this have on the businesses ability to secure required resources, stand out from competition etc. Equally is the entrepreneur entering this business because of attention, or do they have appropriate history. In the absence of this focus, how does the business establish interest in it. (e.g. It&#39;s easier for Google or Facebook to hire talented developers compared to a local waste management company).</p>\n</div>\n\n<div>\n<h3>5.4 TECHNOLOGICAL</h3>\n\n<p><strong>Broad Environment</strong> Is the business aware of the broad environmental changes in technology, and is the business utilizing these to maximize resource efficiency in the business- this can relate to things like what software tools the business employs to coordinate staff and communication, access overseas suppliers etc.</p>\n\n<p><strong>Infrastructure</strong> Does the business require any specific technological infrastructure to create the product, or will this business be impacted by the emergence of a future infrastructure.</p>\n</div>\n</div>\n</div>\n\";}','2017-07-28 09:01:55','2017-07-28 09:03:21','risk_content','true',-1,-1,NULL,NULL,42,'10018'),(44,'Terms & Conditions','terms-conditions','a:1:{s:7:\"content\";s:7889:\"<h2>Privacy Policy</h2>\n\n<p>This policy was last updated on 28st February 2017 and sets out Ready Ninety&rsquo;s (CPP ABN:) policies relating to management of your personal information. These policies are based on our obligations under the Privacy Act 1988 (Commonwealth) including the Australian Privacy Principles.</p>\n\n<p>By voluntarily supplying us with your personal information, you are agreeing to be bound by the Policy. This policy is periodically reviewed and any amendments will be posted to our website. Note that Ready Ninety&rsquo;s website and Facebook page contain links to other websites. When a user has clicked on a link to another site, they leave the Ready Ninety&rsquo;s site and are no longer protected by this Policy.</p>\n\n<h3>Collection of Information</h3>\n\n<p>Ninety Ready collects and/or holds the following kinds of personal information:</p>\n\n<p>1. contact information such as name, address, email address and telephone numbers;<br />\n2. education and employment information, work history, information related to career development;<br />\n3. any other information voluntarily provided by you, including through our website or social media;<br />\n4. information is collected by Ninety Ready via correspondence from you or your company. This may be via the telephone, social media, email, mail, fax or directly through our website.</p>\n\n<h3>What do we use your personal information for?</h3>\n\n<p>Personal information is collected, held, used and disclosed by Ninety Ready for the following purposes:</p>\n\n<p>1. to provide further information about Ninety Ready and the services we provide and any other information&nbsp;you may require from time to time;<br />\n2. to market or promote our services directly to individuals, businesses and other potential stakeholders and/or partners (unless otherwise requested);<br />\n3. to resolve a complaint;<br />\n4. to develop and or provide products and services that may interest you;<br />\n5. to personalise your experience with Ninety Ready;<br />\n6. to improve our website and customer service;<br />\n7. to provide data and information to funding bodies to meet contractual obligations; and<br />\n8. for other related purposes.</p>\n\n<h3>How do we collect and hold your personal information?</h3>\n\n<p>Ninety Ready collects the information voluntarily supplied by you through our website enquiry forms and when we&nbsp;provide our services to you. If the personal information is not collected, we may not be able to provide you with&nbsp;the products or services we offer.</p>\n\n<p>Ninety Ready holds all personal information in electronic and/or physical form. We store information in access controlled&nbsp;premises and in electronic databases requiring logins and passwords.</p>\n\n<h3>How do we protect your personal information?</h3>\n\n<p>Ninety Ready is committed to keeping secure the personal information you provide us and we will take all reasonable&nbsp;precautions to protect your personally identifiable information from loss, misuse, interference, unauthorised&nbsp;access or alteration.</p>\n\n<p>We aim to achieve this through:</p>\n\n<p>1. imposing confidentiality requirements on our employees;<br />\n2. implementing policies in relation to document storage security;<br />\n3. implementing security measures to govern access to our systems;<br />\n4. only providing access to personal information once proper identification has been given;<br />\n5. controlling access to our premises; and<br />\n6. implementing website protection measures.</p>\n\n<h3>When do we disclose and how do we use personal information?</h3>\n\n<p>Ninety Ready has a duty to keep our customers&rsquo; personal information confidential. Our duty of confidentiality applies except where we have consent to disclose personal information, the disclosure is permitted under the APPs or is&nbsp;compelled by law.</p>\n\n<p>Ninety Ready will only use your personal information for the purposes for which it was collected (&ldquo;primary purposes&rdquo;)&nbsp;or a purpose related to the primary purpose, if this use would be reasonably expected by you, or otherwise, with&nbsp;your consent.</p>\n\n<p>We may disclose your personal information to necessary third parties, who assist us to provide, manage and&nbsp;administer our services and products. In which case, your personal information will be dealt with in accordance&nbsp;with that entity&rsquo;s privacy policy.</p>\n\n<h3>Legal</h3>\n\n<p>We reserve the right to disclose your personally identifiable information as required by law and when we believe that disclosure is necessary to protect our rights and/or comply with a judicial proceeding, court order, or legal process served on our Website.</p>\n\n<h3>How can you seek access to and correction of your personal information?</h3>\n\n<p>You can contact us at any time to request access to your personal information or for your personal information to&nbsp;be corrected or updated. Please direct your request to the Privacy Officer via the details provided in this Policy.</p>\n\n<p>Ninety Ready will, on request, provide you with access to your personal information or update or correct your personal&nbsp;information, unless the APPs provide an exception to us granting your request. Your request for access to your personal information or to update or correct your personal information will be&nbsp;dealt with by the Privacy Officer as soon as reasonably practicable. If we deny your request, we will provide you&nbsp;with a written notice detailing reasons for the refusal and the process for making a complaint about the refusal to&nbsp;grant your request. Upon accepting a request for correction of your personal information, we will take all steps that are reasonable in&nbsp;the circumstances, having regard to the purpose for which your personal information is held, to correct your&nbsp;personal information.</p>\n\n<h3>Dealing with us anonymously</h3>\n\n<p>You can deal with Ninety Ready anonymously or using a pseudonym when making a general enquiry about the services that we can offer you. However if you wish to access the services we provide, you will be required to provide your personal contact information.</p>\n\n<p>You may request at the start of any telephone call with us, in relation to a general enquiry, to remain anonymous&nbsp;(or you may use a pseudonym). You will also be given the opportunity to remain anonymous or use a pseudonym&nbsp;when completing a website enquiry form.</p>\n\n<h3>Complaints</h3>\n\n<p>If you believe that Ninety Ready has breached a term of this Policy or the APPs, you may submit a written complaint.</p>\n\n<p>The written complaint can be emailed or posted to us using the contact details set out below. You must include&nbsp;contact details for us to contact you regarding your complaint. Our Privacy Officer will consider your complaint and respond as soon as reasonably possible, but not more than&nbsp;30 days from receiving the complaint. If you remain dissatisfied with the outcome, you may&nbsp;refer your complaint to the Office of the Australian Information Commissioner to be resolved.</p>\n\n<h3>Contact Us</h3>\n\n<p>If you wish to:</p>\n\n<p>1. gain access to your personal information<br />\n2. make a complaint about a breach of your privacy<br />\n3. contact us with a query about how your personal information is collected or used<br />\n4. contact us regarding any other matter concerning this Policy</p>\n\n<p>you can speak directly with our staff who will do their best to try to resolve your issue as simply as possible.</p>\n\n<p>Alternatively, you can write to us or send us an email so that our Privacy Officer can consider the matter (details below). We will&nbsp;respond to you as soon as reasonably possible.</p>\n\n<p><strong>Privacy Officer</strong> &ndash; Andrew Bensley, P: 61+ 08 8269 3795, Ready Ninety, 4 Iona Street Broadview South Australia 5083</p>\n\n<p>admin@ninetyready.com</p>\n\";}','2017-07-28 09:02:25',NULL,'risk_content','true',-1,-1,NULL,NULL,43,'10018'),(48,'who we are',NULL,'a:1:{s:5:\"image\";s:25:\"/data/image/slider-01.png\";}','2017-11-22 09:19:21',NULL,'homeslider','true',-1,-1,NULL,NULL,44,'10001'),(49,'our mission',NULL,'a:1:{s:5:\"image\";s:27:\"/data/image/slider-01-2.png\";}','2017-11-22 09:20:33',NULL,'homeslider','true',-1,-1,NULL,NULL,45,'10001'),(50,'our convicsion',NULL,'a:1:{s:5:\"