70,'10001'),(75,'MOANA',NULL,'a:2:{s:4:\"desc\";s:22:\"ANIMATION FOR CHILDREN\";s:5:\"image\";s:23:\"/assets/images/img1.png\";}','2017-12-25 15:52:53','2017-12-25 15:55:44','cds','true',100,-1,NULL,NULL,71,'10001'),(76,'MOANA(copy)',NULL,'a:2:{s:5:\"image\";s:23:\"/assets/images/img2.png\";s:4:\"desc\";s:22:\"ANIMATION FOR CHILDREN\";}','2017-12-25 15:55:53','2017-12-25 15:56:20','cds','true',101,-1,NULL,NULL,72,'10001'),(77,'MOANA(copy)',NULL,'a:2:{s:5:\"image\";s:23:\"/assets/images/img1.png\";s:4:\"desc\";s:22:\"ANIMATION FOR CHILDREN\";}','2017-12-25 15:56:31',NULL,'cds','true',100,-1,NULL,NULL,73,'10001'),(78,'MOANA(copy)',NULL,'a:2:{s:5:\"image\";s:23:\"/assets/images/img1.png\";s:4:\"desc\";s:22:\"ANIMATION FOR CHILDREN\";}','2017-12-25 15:56:36',NULL,'cds','true',100,-1,NULL,NULL,74,'10001'),(79,'MOANA(copy)(copy)',NULL,'a:2:{s:5:\"image\";s:23:\"/assets/images/img2.png\";s:4:\"desc\";s:22:\"ANIMATION FOR CHILDREN\";}','2017-12-25 15:56:40',NULL,'cds','true',101,-1,NULL,NULL,75,'10001');
